[9293] = {name = "Receta: poción de resistencia a la magia", additional_info = "Requiere\nAlquimia\n(210)\nUso: Enseña a confeccionar una poción de resistencia a la magia.\nPoción de resistencia a la magia\nNecesitas ser de nivel 32\nUso: Aumenta tu resistencia a todos los tipos de magia en 50 p. durante 3 min. (2 Min Reutilización)\nRequiere Mostacho de Khadgar , Loto morado , Vial de cristal"},
[9294] = {name = "Receta: poción de atriplex salvaje", additional_info = "Requiere\nAlquimia\n(225)\nUso: Enseña a confeccionar una poción de atriplex salvaje.\nPoción de atriplex salvaje\nNecesitas ser de nivel 35\nUso: Restaura 1 to 1500 p. de salud y 1 to 1500 de maná. (2 Min Reutilización)\nRequiere Atriplex salvaje , Loto morado , Vial de cristal"},
[9295] = {name = "Receta: poción de invisibilidad", additional_info = "Requiere\nAlquimia\n(235)\nUso: Enseña a confeccionar una poción de invisibilidad.\nPoción de invisibilidad\nNecesitas ser de nivel 37\nUso: Da a quien lo ingiere invisibilidad durante 18 sec. (10 Min Reutilización)\nRequiere Champiñón fantasma , Solea , Vial de cristal"},
[9296] = {name = "Receta: obsequio de Arthas", additional_info = "Requiere\nAlquimia\n(240)\nUso: Enseña a confeccionar un regalo de Arthas.\nOfrenda de Arthas\nNecesitas ser de nivel 38\nUso: Aumenta la resistencia a las Sombras en 10 p. Si un enemigo ataca a quien la ingiere, el atacante tiene un 30% de probabilidad de enfermar de forma que aumente el daño que reciba en 8 p. durante 3 min. Dura 30 min. (Probabilidad de que accione: 30%) (3 Seg Reutilización)\nRequiere Lágrimas de Arthas , Carolina , Vial de cristal"},
[9297] = {name = "Receta: elixir de visión de ensueño", additional_info = "Requiere\nAlquimia\n(240)\nUso: Enseña a confeccionar un elixir de visión onírica.\nElixir de visión de ensueño\nNecesitas ser de nivel 38\nUso: Te da una visión de ensueño a través de la cual puedes explorar áreas demasiado peligrosas para explorarlas personalmente. (3 Seg Reutilización)\nRequiere Loto morado (3), Vial de cristal"},
[9298] = {name = "Receta: elixir de gigantes", additional_info = "Requiere\nAlquimia\n(245)\nUso: Enseña a confeccionar un elixir de gigantes.\nElixir de gigantes\nNecesitas ser de nivel 38\nUso: Aumenta tu fuerza en 25 durante 1 hour. (3 Seg Reutilización)\nRequiere Solea , Gromsanguina , Vial de cristal"},
