[13506] = {name = "Frasco de petrificación", additional_info = "Necesitas ser de nivel 50\nUso: Te conviertes en piedra, lo que te protege de ataques físicos y hechizos durante 1 min, pero no puedes moverte, atacar ni lanzar hechizos. Solo puedes tener el efecto de un frasco cada vez. (3 Seg Reutilización)"},
