[13508] = {name = "Ojo de Arachnida", additional_info = "Se liga al recogerlo\nÚnico\nNecesitas ser de nivel 55\nUso: Invoca un Ojo de Kilrogg y vincula tu visión a él. El ojo se mueve con rapidez pero es muy frágil. (1 Min Reutilización)\n3 cargas"},
[13509] = {name = "Garra de Previsión", additional_info = "Se liga al recogerlo\nÚnico\nNecesitas ser de nivel 55\nUso: Contrarresta el lanzamiento de hechizos del enemigo, evitando que lance hechizos de esa escuela de magia durante 10 sec. Genera una gran cantidad de amenaza. (1 Min Reutilización)"},
