[16040] = {name = "Bomba Arcana", additional_info = "Requiere\nIngeniería\n(300)\nUso: Drena 675 to 1125 p. de maná de todo el que es alcanzado por la explosión y convierte el 50% del maná drenado en daño que afecta al objetivo. Además silencia a los objetivos alcanzados por la explosión durante 5 sec. (1 Min Reutilización)"},
[16041] = {name = "Esquema: granada de torio", additional_info = "Requiere\nIngeniería\n(260)\nUso: Enseña a confeccionar una granada de torio.\nGranada de torio\nRequiere\nIngeniería\n(260)\nUso: Inflige 300 to 500 p. de daño de Fuego y aturde durante 3 sec a los objetivos que estén en un radio de 3 metros. Cualquier daño romperá el efecto. (1 Min Reutilización)\nRequiere Trastos wow de torio , Lingote de torio (3), Pólvora densa (3), Paño rúnico (3)"},
[16042] = {name = "Esquema: trastos wow de torio", additional_info = "Requiere\nIngeniería\n(260)\nUso: Enseña a confeccionar un trasto de torio.\nTrastos wow de torio\nRequiere Lingote de torio (3), Paño rúnico"},
[16043] = {name = "Esquema: rifle de torio", additional_info = "Requiere\nIngeniería\n(260)\nUso: Enseña a confeccionar un rifle de torio.\nRifle de torio\nSe liga al equiparlo\nA distancia Arma de fuego\n42 - 79 Daño Velocidad 2.50\n(24.20 daño por segundo)\nDurabilidad 65 / 65\nNecesitas ser de nivel 47\nEquipar: +17 p. de poder de ataque a distancia.\nRequiere Tubo de mitril (2), Envoltura de mitril (2), Trastos wow de torio (2), Lingote de torio (4), Mira mortal"},
[16044] = {name = "Esquema: sapo mecánico casi vivo", additional_info = "Requiere\nIngeniería\n(265)\nUso: Enseña a confeccionar un sapo mecánico semivivo.\nSapo mecánico casi vivo\nSe liga al usarlo\nUso: Haz clic con el botón derecho del ratón para invocar y retirar a tu sapo mecánico semivivo.\nRequiere Esencia viva , Trastos wow de torio (4), Núcleo de energía de oro , Cuero basto"},
[16045] = {name = "Esquema: gafas extremas de hechizo de poder plus", additional_info = "Requiere\nIngeniería\n(270)\nUso: Enseña a confeccionar unas gafas hechizorosas extremas plus.\nGafas extremas de hechizo de poder plus\nSe liga al equiparlo\nCabeza Tela\n57 armadura\nDurabilidad 45 / 45\nRequiere\nIngeniería\n(270)\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 27 p.\nRequiere Gafas extremas de hechizo de poder , Rubí estrella (4), Cuero encantado (2), Paño rúnico (8)"},
[16046] = {name = "Esquema: muñeco-diana magistral", additional_info = "Requiere\nIngeniería\n(275)\nUso: Enseña a confeccionar un muñeco-diana obra maestra.\nMuñeco-diana magistral\nRequiere\nIngeniería\n(275)\nUso: Coloca un muñeco-diana en el suelo que atrae los ataques de los monstruos cercanos. Dura 15 s o hasta que lo matan. (2 Min Reutilización)\nRequiere Envoltura de mitril , Tubo de torio , Trastos wow de torio (2), Lingote de veraplata , Cuero basto (2), Paño rúnico (4)"},
[16047] = {name = "Esquema: tubo de torio", additional_info = "Requiere\nIngeniería\n(275)\nUso: Enseña a confeccionar un tubo de torio.\nTubo de torio\nRequiere Lingote de torio (6)"},
[16048] = {name = "Esquema: rifle Hierro Negro", additional_info = "Requiere\nIngeniería\n(275)\nUso: Enseña a confeccionar un rifle Hierro Negro.\nRifle Hierro Negro\nSe liga al equiparlo\nA distancia Arma de fuego\n53 - 100 Daño Velocidad 2.70\n(28.33 daño por segundo)\nDurabilidad 75 / 75\nNecesitas ser de nivel 50\nEquipar: Probabilidad de golpear a tu objetivo a distancia con un Disparo de las Sombras, infligiendo 18 to 26 de daño de las Sombras.\nRequiere Tubo de torio (2), Lingote Hierro Negro (6), Mira mortal (2), Zafiro azul (2), Ópalo grande (2), Cuero basto (4)"},
[16049] = {name = "Esquema: bomba Hierro Negro", additional_info = "Requiere\nIngeniería\n(285)\nUso: Enseña a confeccionar una bomba Hierro Negro.\nBomba Hierro Negro\nRequiere\nIngeniería\n(285)\nUso: Inflige 225 to 675 p. de daño de Fuego y aturde a los objetivos de un radio de 5 metros durante 4 sec. Cualquier daño romperá el efecto. (1 Min Reutilización)\nRequiere Trastos wow de torio (2), Lingote Hierro Negro , Pólvora densa (3), Paño rúnico (3)"},
[16050] = {name = "Esquema: conversor de arcanita delicado", additional_info = "Requiere\nIngeniería\n(285)\nUso: Enseña a confeccionar un convertidor frágil de arcanita.\nConversor de arcanita delicado\nRequiere Lingote de arcanita , Seda de araña Tejehierro"},
[16051] = {name = "Esquema: proyectiles de torio", additional_info = "Requiere\nIngeniería\n(285)\nUso: Enseña a confeccionar balas de torio.\nProyectiles de torio\nMunición Bala\nAñade 17.5 daño por segundo\nNecesitas ser de nivel 52\nRequiere Lingote de torio (2), Pólvora densa"},
[16052] = {name = "Esquema: modulador de amplificación de voz", additional_info = "Requiere\nIngeniería\n(290)\nUso: Enseña a confeccionar un modulador de amplificación de voz.\nModulador de amplificación de voz\nSe liga al equiparlo\nCuello\nEquipar: Aumenta tu resistencia a los efectos del silencio en un 7%.\nRequiere Conversor de arcanita delicado (2), Núcleo de energía de oro , Trastos wow de torio , Ópalo grande"},
[16053] = {name = "Esquema: gafas de maestro ingeniero", additional_info = "Requiere\nIngeniería\n(290)\nUso: Enseña a confeccionar protección de ingeniero jefe.\nGafas de maestro ingeniero\nSe liga al equiparlo\nCabeza Tela\n61 armadura\n+16 aguante\n+17 espíritu\nDurabilidad 45 / 45\nRequiere\nIngeniería\n(280)\nRequiere Gafas de Fuego , Esmeralda enorme (2), Cuero encantado (4)"},
[16054] = {name = "Esquema: dragonizo de arcanita", additional_info = "Requiere\nIngeniería\n(300)\nUso: Enseña a confeccionar un dragonizo de arcanita.\nDragonizo de arcanita\nSe liga al equiparlo\nÚnico\nAlhaja\nNecesitas ser de nivel 50\nRequiere\nIngeniería\n(300)\nUso: Activa tu Dragonizo de arcanita para que luche por ti durante 1 min. El tiempo de regeneración es de una hora. (1 Hora Reutilización)\nRequiere Dragonizo mecánico de mitril , Conversor de arcanita delicado (8), Lingote de torio encantado (10), Trastos wow de torio (6), Núcleo de energía de oro (4), Cuero encantado (6)"},
