[19951] = {name = "Talismán de Poderío de Gri'lek", additional_info = "Se liga al recogerlo\nÚnico\nAlhaja\nClases: Guerrero\nNecesitas ser de nivel 60\nUso: Aumenta instantáneamente tu ira en 30 p. (3 Min Reutilización)\n\nEquipo de batalla del Vindicador (0/5)\nTalismán de Poderío de Gri'lek\nIra de Mugamba\nGuardabrazos de vindicador Zandalar\nCinturón de vindicador Zandalar\nPeto de vindicador Zandalar\n(2) Conjunto : Aumenta la probabilidad de bloquear ataques con un escudo en un 2%.\n(3) Conjunto : Reduce el tiempo de reutilización de Grito intimidador en 15 s.\n(5) Conjunto : Reduce el consumo de ira de Huracán en 3 p."},
