[20002] = {name = "Poción superior de letargo sin sueños", additional_info = "Necesitas ser de nivel 55\nUso: Quien lo bebe entra en un letargo sin sueños durante 12 sec. Durante ese tiempo, se cura 2100 p. de salud y 2100 p. de maná. (2 Min Reutilización)"},
