[20035] = {name = "Punta glacial", additional_info = "Se liga al recogerlo\nUna mano Daga\n31 - 59 Daño Velocidad 1.30\n(34.62 daño por segundo)\n+4 intelecto\nDurabilidad 65 / 65\nEquipar: Tus hechizos Descarga de Escarcha tienen un 6% de probabilidad de restaurar 50 p. de maná al lanzarlos.\n\"Runas diabólicas adornan la espada.\""},
