[23059] = {name = "Anillo de Acorator", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n+27 aguante\nClases: Guerrero\nNecesitas ser de nivel 60\nEquipar: Aumenta la probabilidad de esquivar un ataque en un 1%.\nEquipar: Defensa aumentada +10.\n\nEquipo de batalla de Acorator (0/9)\nBrazales Acorator\nPeto Acorator\nGuanteletes Acorator\nGuardarrenes Acorator\nCasco Acorator\nQuijotes Acorator\nHombreras Acorator\nEscarpes Acorator\nAnillo de Acorator\n(2) Conjunto : Aumenta en 75 p. el daño causado con tu facultad de Revancha.\n(4) Conjunto : Mejora tu probabilidad de alcanzar el objetivo con el hechizo de Irritar y el de Grito desafiante en un 5%.\n(6) Conjunto : Mejora en un 5% tu probabilidad de alcanzar el objetivo con el hechizo Hender armadura, Golpe heroico, Revancha y Escudazo.\n(8) Conjunto : Si tu salud desciende a menos del 20%, durante los 5 segundos siguientes los hechizos curativos que te lancen te ayudarán a Burlar a la muerte aumentando la curación en 160."},
[23060] = {name = "Anillo segahuesos", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n+20 fuerza\n+20 agilidad\n+10 aguante\nClases: Pícaro\nNecesitas ser de nivel 60\nEquipar: Mejora tu probabilidad de alcanzar el objetivo en un 1%.\n\nArmadura de Segahuesos (0/9)\nBrazales segahuesos\nPeto segahuesos\nGuanteletes segahuesos\nCasco segahuesos\nQuijotes segahuesos\nEspaldares segahuesos\nEscarpes segahuesos\nGuardarrenes segahuesos\nAnillo segahuesos\n(2) Conjunto : Tus golpes cuerpo a cuerpo normales tienen una probabilidad de aplicarte Envigorizar, lo que te curará en 90 to 110.\n(4) Conjunto : Tus golpes críticos de Puñalada, Golpe siniestro y Hemorragia te hacen recuperar 5 p. de energía. (500ms de reutilización)\n(6) Conjunto : Reduce la amenaza de tus facultades Puñalada, Golpe siniestro, Hemorragia y Eviscerar.\n(8) Conjunto : Tu hechizo Eviscerar tiene una probabilidad por punto de combo de revelar una debilidad en la armadura del enemigo y otorga el 100% de probabilidad de golpe crítico en el siguiente hechizo Puñalada, Golpe siniestro o Hemorragia."},
[23061] = {name = "Anillo de Fe", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n+16 intelecto\n+16 espíritu\nClases: Sacerdote\nNecesitas ser de nivel 60\nEquipar: Aumenta la curación de los hechizos y los efectos hasta en 55 p.\n\nVestimentas de la Fe (0/9)\nCinturón de Fe\nAtaduras de Fe\nAro de Fe\nGuantes de Fe\nLeotardos de Fe\nToga de Fe\nSandalias de Fe\nHombreras de Fe\nAnillo de Fe\n(2) Conjunto : Reduce el coste de maná de tu hechizo Renovar en un 12%.\n(4) Conjunto : En golpes críticos de Curación superior, tu objetivo ganará Armadura de Fe y absorberá hasta 500 p. de daño.\n(6) Conjunto : Reduce la amenaza de tus hechizos curativos.\n(8) Conjunto : Cada hechizo que lanzas puede activar una Epifanía que aumenta la regeneración de maná en 24 p. durante 30 sec. (Probabilidad de que accione: 5%)"},
[23062] = {name = "Anillo Escarchafuego", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n+10 aguante\n+10 intelecto\nClases: Mago\nNecesitas ser de nivel 60\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 30 p.\nEquipar: Mejora tu probabilidad de conseguir un golpe crítico en 1% con los hechizos.\n\nRopajes de Fuegoescarcha (0/9)\nCinturón Escarchafuego\nAtaduras Escarchafuego\nAro Escarchafuego\nGuantes Escarchafuego\nLeotardos Escarchafuego\nToga Escarchafuego\nSandalias Escarchafuego\nHombreras Escarchafuego\nAnillo Escarchafuego\n(2) Conjunto : Reduce el tiempo de regeneración de tu Evocación en 1 min.\n(4) Conjunto : Da a tu armadura de mago una probabilidad de que, al ser alcanzada por un hechizo nocivo, aumente su resistencia frente a ese tipo de magia en 35 p. durante 30 sec. (Probabilidad de que accione: 20%)\n(6) Conjunto : Tus hechizos de daño tienen una probabilidad de causar al objetivo hasta 200 p. extra de daño en los siguientes hechizos. (Probabilidad de que accione: 20%)\n(8) Conjunto : Tus hechizos de daño tienen una probabilidad de desplazarte y hacer que el siguiente hechizo no cause amenaza. (Probabilidad de que accione: 15%)"},
[23063] = {name = "Anillo Corazón de la Peste", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n+24 aguante\nClases: Brujo\nNecesitas ser de nivel 60\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 29 p.\n\nVestidura Corazón de la Peste (0/9)\nCinturón Corazón de la Peste\nAtaduras Corazón de la Peste\nAro Corazón de la Peste\nGuantes Corazón de la Peste\nLeotardos Corazón de la Peste\nToga Corazón de la Peste\nSandalias Corazón de la Peste\nHombreras Corazón de la Peste\nAnillo Corazón de la Peste\n(2) Conjunto : Tus hechizos Descarga de las Sombras tienen una probabilidad de curarte en 270 to 330.\n(4) Conjunto : Aumenta el daño causado por tu Corrupción en un 12%.\n(6) Conjunto : Los golpes críticos de tus hechizos generan un 25% menos de amenaza. Además, Corrupción, Inmolar, Maldición de Agonía y Absorber vida generan un 25% menos de amenaza.\n(8) Conjunto : Reduce el consumo de salud de tu Transfusión de vida en un 12%."},
[23064] = {name = "Anillo del Caminasueños", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n+16 aguante\n+16 intelecto\n+16 espíritu\nClases: Druida\nNecesitas ser de nivel 60\nEquipar: Aumenta la curación de los hechizos y los efectos hasta en 37 p.\n\nVestiduras de Oninámbulo (0/9)\nBotas Caminasueños\nFaja Caminasueños\nManoplas Caminasueños\nCelada Caminasueños\nMusleras Caminasueños\nBufas Caminasueños\nTúnica Caminasueños\nMuñequeras Caminasueños\nAnillo del Caminasueños\n(2) Conjunto : Tu hechizo de Rejuvenecimiento tiene una probabilidad de restaurar 60 p. de maná, 8 p. de energía o 2 p. de ira del objetivo.\n(4) Conjunto : Reduce el coste de maná de tus hechizos Toque curativo, Recrecimiento, Rejuvenecimiento y Tranquilidad en un 3%.\n(6) Conjunto : Tu lanzamiento inicial y Recrecimiento aumentan la salud máxima del objetivo hasta 50 p. y se acumula hasta 7 veces.\n(8) Conjunto : En golpes críticos de Toque de curación recuperarás el 30% del coste de maná del hechizo."},
