[190308] = {name = "Antorcha encendida", additional_info = "Objeto mágico\nObjeto de misión\nÚnico\nDuración: 5 min\nUso: Lanza una antorcha al área objetivo y le prende fuego.\n\"¡Útil para ardientes distracciones!\""},
