[191249] = {name = "Piedra de muerte superior", additional_info = "Se liga al recogerlo\n\"Una piedra verde brillante que emite energías ocultas.\""},
[191267] = {name = "Runa de Teletransporte: Antecámara", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Te teletransporta a la Antecámara de Naxxramas."},
[191268] = {name = "Orbe de corrupción", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Destroza el orbe para aumentar las piedras de muerte inferiores que se absorben de los esbirros de Kel'Thuzad en un 50% durante 30 min."},
[191272] = {name = "Vara de necromancia", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Subyuga la voluntad de un objetivo no-muerto en Naxxramas, que queda embelesado durante 5 min.\n3 cargas"},
[191280] = {name = "Cúmulo de esporas fúngicas", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Otorga a tus facultades ofensivas la probabilidad de invocar una espora que afecta a los jugadores cercanos con Florecer fungal al morir. El efecto dura 1 hour.\n\nFlorecer fungal \nInflige 150 p. de daño de Naturaleza cada 1 s y aumenta la probabilidad de asestar un crítico cuerpo a cuerpo, a distancia o de hechizo en un 15%. (Probabilidad de que accione: 10%, 15s de reutilización)"},
[191288] = {name = "Runa de Teletransporte: Guarida de la Vermis de Escarcha", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Te teletransporta a la Guarida de la Vermis de Escarcha en Naxxramas."},
[191292] = {name = "Daga ritual", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Absorbes la fuerza vital de los que te rodean, lo que aumenta en 3 p. tu aguante por cada objetivo golpeado. Este efecto se acumula hasta 40 veces y dura 1 hour."},
[191312] = {name = "Filacteria de seguridad", additional_info = "Se liga al recogerlo\nÚnico\nDuración: 7 días\nAlhaja\nNecesitas ser de nivel 60\nEquipar: Evita un ataque que provocaría tu muerte. Cuando se activa este efecto, también obtienes inmunidad al daño durante 3 sec y la filacteria queda destrozada."},
[191313] = {name = "Máscara de muerte", additional_info = "Duración: 7 días\nUso: Adoptas el rostro de un habitante de Naxxramas."},
[191414] = {name = "Artefacto esquelético", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Atrapas el alma del objetivo muerto, lo que te otorga un efecto beneficioso. El efecto dura 1 hour."},
[191458] = {name = "Filacteria destrozada", additional_info = "Se liga al recogerlo\nÚnico\nDuración: 7 días\nAlhaja\nNecesitas ser de nivel 60\n\"Aburrido e inútil.\""},
[191459] = {name = "Runa de fortuna", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Potencia a Kel'Thuzad y a sus tenientes con energía nigromántica, lo que les otorga salud y daño aumentados. Los enemigos potenciados otorgarán recompensas extra al caer derrotados.\n\n Este efecto se acumula y dura una semana."},
[191477] = {name = "Amarradero esquelético", additional_info = "Se liga al recogerlo\nÚnico\nDuración: 7 días\nNecesitas ser de nivel 60\nUso: Invocas un amarradero esquelético.\n\n Los miembros del grupo pueden usar el amarradero para obtener un corcel esquelético."},
[191480] = {name = "Corcel esquelético", additional_info = "Se liga al recogerlo\nÚnico\nDuración: 1 hora\nMontura\nNecesitas ser de nivel 40\nUso: Invoca y retira un corcel esquelético. Este corcel obedece a quien lo ha invocado y se puede utilizar como montura en Naxxramas. Toda acción hostil contra su jinete obliga al corcel a huir aterrorizado. (3 Seg Reutilización)"},
[191481] = {name = "Tabardo de maestría", additional_info = "Se liga al recogerlo\nTabardo\n\"Un testimonio de maestría.\""},
[191550] = {name = "Libro de las piedras de muerte: máscara de muerte", additional_info = "Se liga al recogerlo\nÚnico\nEste objeto inicia una misión\nNecesitas ser de nivel 60\n\"Un volumen que detalla el arte de crear una máscara de muerte con piedras de muerte.\""},
