[191656] = {name = "Esencia de la muerte", additional_info = "Se liga al recogerlo\n<Click derecho para abrir>"},
[191660] = {name = "Descargas de relámpagos de Thaddius", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Fijas las descargas a tu cuello, lo que aplica de forma aleatoria cargas positivas o negativas que te otorgan un 1% más de daño y sanación.\n\n Este efecto se acumula si hay aliados cercanos con una carga similar e inflige daño de Naturaleza a los aliados con una carga contraria."},
[191661] = {name = "Colmillo de araña monstruoso", additional_info = "Se liga al recogerlo\nDuración: 7 días\nUso: Te clavas el colmillo, lo que aumenta tus velocidades de movimiento, de ataque y de lanzamiento en un 15% durante 1 hour. (Probabilidad de que accione: 5%, 30s de reutilización)"},
[191664] = {name = "Libro de las piedras de muerte: descargas de relámpagos de Thaddius", additional_info = "Se liga al recogerlo\nÚnico\nEste objeto inicia una misión\nNecesitas ser de nivel 60\n\"Un volumen que detalla el arte de crear descargas de relámpagos de Thaddius con piedras de muerte.\""},
[191666] = {name = "Libro de las piedras de muerte: colmillo de araña monstruoso", additional_info = "Se liga al recogerlo\nÚnico\nEste objeto inicia una misión\nNecesitas ser de nivel 60\n\"Un volumen que detalla el arte de crear un colmillo de araña monstruoso con piedras de muerte.\""},
[202251] = {name = "Bolsa de chucherías para mascotas", additional_info = "Se liga al recogerlo\nUso: Abres la bolsa de golosinas y las metes en el bolsillo de tu objetivo, lo que aumenta 20 p. el daño de las bestias contra este objetivo. (1 Min Reutilización)"},
[202254] = {name = "Brazales de redirección", additional_info = "Se liga al equiparlo\nMuñeca Cuero\n44 armadura\n+11 aguante\n+13 intelecto\n+8 espíritu\nDurabilidad 35 / 35\nNecesitas ser de nivel 60\nEquipar: Mejora tu probabilidad de conseguir un golpe crítico en 1% con los hechizos."},
[202256] = {name = "Pistola ornamentada de corsario", additional_info = "Se liga al recogerlo\nA distancia Arma de fuego\n6 - 13 Daño Velocidad 1.90\n(5.00 daño por segundo)\nDurabilidad 35 / 35\nClases: Pícaro\nEquipar: Consigues la facultad Desenvainado rápido:\n\n\nDesenfundas tu arma a distancia y le pegas un tiro rápido a un enemigo que le inflige daño con arma a distancia normal y reduce su velocidad de movimiento un 50% durante 6 sec. Otorga 1 p. de combo.\n\n Desenvainado rápido se beneficia de todos los talentos y efectos que activa o modifica Golpe siniestro."},
[202316] = {name = "Runecarving Test - Crippling Poison", additional_info = "Clases: Pícaro\nNecesitas ser de nivel 20\nUso: Cubre un arma con un veneno que dura 30 min.\n Cada golpe tiene un 30% de probabilidad de envenenar al enemigo y reducir su velocidad de movimiento un 50% durante 12 sec. (Probabilidad de que accione: 30%)"},
[202641] = {name = "Libro embarrado", additional_info = "Se liga al recogerlo\nEste objeto inicia una misión\nClases: Pícaro\n\"Este libro está cubierto de barro, pero tiene runas escritas en sus páginas y una pequeña nota escrita en una jerga que desconoces.\""},
[203723] = {name = "Nota de Cutty", additional_info = "Se liga al recogerlo\nClases: Pícaro\n\"Un mensaje escrito en la jerga de los ladrones.\"\n<Click derecho para leer>"},
[203726] = {name = "Runa de Cutty", additional_info = "Clases: Pícaro"},
[203745] = {name = "Notas sobre hechizos: Lanza de hielo", additional_info = "Se liga al recogerlo\nÚnico\nRequiere\nGrabado\n(1)\nGrabas en tus guantes la runa de Lanza de hielo:\n\n\nInflige de (* 55 / 100) a (* 65 / 100) p. de daño de Escarcha a un objetivo enemigo. Inflige el triple de daño contra objetivos congelados.\n\"Te enseña una nueva facultad de talla de runas.\""},
[203746] = {name = "Notas sobre hechizos: Llama viviente", additional_info = "Se liga al recogerlo\nÚnico\nRequiere\nGrabado\n(1)\nGrabas en tus pantalones la runa de Llama viva:\n\n\nInvoca una llama de Piroarcano que se mueve hacia el objetivo y deja un rastro de Piroarcano. Este rastro inflige (* 100 / 100) p. de daño de Piroarcano cada segundo a los enemigos cercanos. Dura 20 sec.\n\"Te enseña una nueva facultad de talla de runas.\""},
[203747] = {name = "Notas sobre hechizos: Dedos de Escarcha", additional_info = "Se liga al recogerlo\nÚnico\nRequiere\nGrabado\n(1)\nGrabas en tu pechera o túnica la runa de Dedos de Escarcha:\n\n\nDa a tus efectos de enfriamiento un 15% de probabilidad de otorgarte el efecto de Dedos de Escarcha, que hace que tus siguientes 2 hechizos traten al objetivo como si estuviese congelado. Dura 15 sec.\n\"Te enseña una nueva facultad de talla de runas.\""},
[203748] = {name = "Notas sobre hechizos: Consunción", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tu pechera la runa de Consunción:\n\n\nAumenta tu probabilidad de golpe crítico con todos los hechizos un 15%, pero ahora tus golpes críticos con hechizos no periódicos tienen un coste de maná extra igual al 1% de tu maná base.\n\"Te enseña una nueva facultad de grabado.\""},
[203749] = {name = "Notas sobre hechizos: Esclarecimiento", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tu pechera o túnica la runa de Esclarecimiento:\n\n\nInfliges un 10% más de daño si tienes más de un 70% de maná. Mientras tu maná está por debajo del 30%, un 10% de la regeneración de maná continúa al lanzar hechizos.\n\"Te enseña una nueva facultad de grabado.\""},
[203750] = {name = "Mapa del tesoro de Elwynn", additional_info = "Se liga al recogerlo\nClases: Pícaro\nUso: Desentierras un tesoro en la ubicación marcada. (1 Min Reutilización)\n\"Al oeste de la Torre de la Peña, cerca del tocón que hay detrás de la guarida de los merodeadores.\""},
[203751] = {name = "Notas sobre hechizos: NLILZA ED HEAO", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nUso: Descifra las notas sobre hechizos con un manual de comprensión para aprender un nuevo hechizo de grabado."},
[203752] = {name = "Notas sobre hechizos: LIAMV VLAA", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nUso: Descifra las notas sobre hechizos con un amuleto de comprensión para aprender un nuevo hechizo de grabado."},
[203753] = {name = "Notas sobre hechizos: DEAR CHDE ESCADOS", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nUso: Descifra las notas sobre hechizos con un amuleto de comprensión para aprender un nuevo hechizo de grabado."},
[203754] = {name = "Archimago Antonidas: Autobiografía completa", additional_info = "Se liga al recogerlo\nÚnico\n\"Un poco autocomplaciente, pero sigue siendo una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[203755] = {name = "Diario de investigación del archimago Theocritus", additional_info = "Único\n\"Notas de investigación de la Torre de Azora. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[203756] = {name = "Notas de aprendiz de Azora: página 1", additional_info = "Se liga al recogerlo\nÚnico\nUso: Combina 6 notas de aprendiz de Azora para crear una nueva receta de grabado."},
[203784] = {name = "Parte superior derecha del mapa", additional_info = "Uso: Combina esto con otros 3 trozos del mapa para completarlo.\n\"Un trozo roto de lo que parece ser un mapa...\""},
[203785] = {name = "Parte superior izquierda del mapa", additional_info = "Uso: Combina esto con otros 3 trozos del mapa para completarlo.\n\"Un trozo roto de lo que parece ser un mapa...\""},
[203786] = {name = "Parte inferior derecha del mapa", additional_info = "Uso: Combina esto con otros 3 trozos del mapa para completarlo.\n\"Un trozo roto de lo que parece ser un mapa...\""},
[203787] = {name = "Parte inferior izquierda del mapa", additional_info = "Uso: Combina esto con otros 3 trozos del mapa para completarlo.\n\"Un trozo roto de lo que parece ser un mapa...\""},
[203960] = {name = "Notas de aprendiz de Azora: página 2", additional_info = "Se liga al recogerlo\nÚnico\nUso: Combina 6 notas de aprendiz de Azora para crear una nueva receta de grabado."},
[203961] = {name = "Notas de aprendiz de Azora: página 3", additional_info = "Se liga al recogerlo\nÚnico\nUso: Combina 6 notas de aprendiz de Azora para crear una nueva receta de grabado."},
[203962] = {name = "Notas de aprendiz de Azora: página 4", additional_info = "Se liga al recogerlo\nÚnico\nUso: Combina 6 notas de aprendiz de Azora para crear una nueva receta de grabado."},
[203990] = {name = "Runa de Mutilación", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus guantes la runa de Mutilar:\n\n\nAtaque instantáneo con ambas armas que inflige un 100% de daño con arma más (100 / 100 *) p. adicionales con cada arma. El daño aumenta un 20% frente a objetivos envenenados. Da 2 p. de combo.\n\n Mutilar se beneficia de todos los talentos y efectos que Puñalada activa o modifica, a no ser que se especifique algo distinto.\n\"Te enseña una nueva facultad de grabado.\""},
[203991] = {name = "Runa de Desenvainado rápido", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tu pechera o túnica la runa de Desenvainado rápido:\n\n\nDesenfundas tu arma a distancia y le pegas un tiro rápido a un enemigo que le inflige daño con arma a distancia normal y reduce su velocidad de movimiento un 50% durante 6 sec. Otorga 1 p. de combo.\n\n Desenvainado rápido se beneficia de todos los talentos y efectos que activa o modifica Golpe siniestro.\n\"Te enseña una nueva facultad de grabado.\""},
[203992] = {name = "Runa de Artimañas", additional_info = "Clases: Pícaro\n\"Te enseña una nueva facultad de grabado.\""},
[203993] = {name = "Runa de Masacre", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tu pechera o túnica la runa de Matanza desde las Sombras:\n\n\nReduce 20 p. el coste de energía de tus facultades Puñalada y Emboscada.\n\nGrabar guantes: Mutilar\nNo se aplica a Mutilar\n\n No se aplica a las facultades aprendidas a partir de otras runas.\n\"Te enseña una nueva facultad de grabado.\""},
[203994] = {name = "Runa de Brebaje letal", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tu pechera o túnica la runa de Brebaje letal:\n\n\nOtorga varias mejoras a tus venenos:\n\n Cuando aplicas cualquier otro veneno a un objetivo, también le aplicas Veneno mortal.\n\n Si tu arma no tiene un veneno aplicado, existe la posibilidad de que se active Veneno instantáneo como si estuviese aplicado.\n\n Veneno mortal y Veneno instantáneo infligen más daño en función de tu poder de ataque.\n\"Te enseña una nueva facultad de grabado.\""},
[204174] = {name = "Runa de Precisión", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus pantalones la runa de Entre ceja y ceja:\n\n\nRemate a distancia que inflige una cantidad de daño por punto de combo que aumenta según el poder de ataque y aturde al objetivo:\n\n 1 p.: de [53 / 100 * ( + )] a [81 / 100 * ( + )] p. de daño y 1 s de aturdimiento\n 2 p.: de [53 / 100 * ( +* 2)] a [81 / 100 * ( +* 2)] p. de daño y 2 s de aturdimiento\n 3 p.: de [53 / 100 * ( +* 3)] a [81 / 100 * ( +* 3)] p. de daño y 3 s de aturdimiento\n 4 p.: de [53 / 100 * ( +* 4)] a [81 / 100 * ( +* 4)] p. de daño y 4 s de aturdimiento\n 5 p.: de [53 / 100 * ( +* 5)] a [81 / 100 * ( +* 5)] p. de daño y 5 s de aturdimiento\n\n El tiempo de reutilización se comparte con Golpe en los riñones.\n\"Te enseña una nueva facultad de grabado.\""},
[204270] = {name = "Núcleo de las profundidades", additional_info = "Único"},
[204441] = {name = "Runa de Frenesí sangriento", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tu pechera la runa de Frenesí sangriento:\n\n\nCada vez que infliges daño de sangrado, obtienes 3 p. de ira.\n\"Te enseña una nueva facultad de grabado.\""},
[204476] = {name = "Cabeza de kóbold cortada", additional_info = "Se liga al recogerlo\nÚnico\n\"Un macabro trofeo. Puede que le interese a algún coleccionista...\""},
[204477] = {name = "Cabeza de múrloc cortada", additional_info = "Se liga al recogerlo\nÚnico\n\"Un macabro trofeo. Puede que le interese a algún coleccionista...\""},
[204478] = {name = "Cabeza de gnoll cortada", additional_info = "Se liga al recogerlo\nÚnico\n\"Un macabro trofeo. Puede que le interese a algún coleccionista...\""},
[204688] = {name = "Fragmento de la primera runa de la cazadora de monstruos", additional_info = "Uso: Combinas con otros 2 trozos de runa para conseguir una completa."},
[204689] = {name = "Fragmento de la segunda runa de la cazadora de monstruos", additional_info = "Uso: Combinas con otros 2 trozos de runa para conseguir una completa."},
[204690] = {name = "Fragmento de la tercera runa de la cazadora de monstruos", additional_info = "Uso: Combinas con otros 2 trozos de runa para conseguir una completa."},
[204703] = {name = "Runa de Devastar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus guantes la runa de Devastar:\n\n\nMientras estás en Actitud defensiva con un escudo equipado, Hender armadura también inflige una cantidad de daño equivalente al 100% del daño por segundo del arma que llevas equipada. Esta cantidad aumenta un 10% por cada aplicación de este hechizo que ya tenga el objetivo.\n\"Te enseña una nueva facultad de grabado.\""},
[204716] = {name = "Runa de Asalto frenético", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus pantalones la runa de Asalto frenético:\n\n\nTu velocidad de ataque aumenta un 20% mientras empuñas armas a 2 manos.\n\"Te enseña una nueva facultad de grabado.\""},
[204795] = {name = "Runa de Tenebrosa", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus guantes la runa de Tenebrosa:\n\n\nTe teletransportas detrás de tu objetivo y lo golpeas para infligirle un 150% del daño con arma. Tienes que estar en modo de sigilo. Otorga 1 p. de combo.\n\"Te enseña una nueva facultad de grabado.\""},
[204804] = {name = "Brazales de Hydraxis", additional_info = "Se liga al recogerlo\nMuñeca Malla\n95 armadura\n+4 fuerza\n+7 aguante\nDurabilidad 40 / 40\nNecesitas ser de nivel 25"},
[204806] = {name = "Runa de Ataque de la victoria", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus guantes la runa de Ataque de la victoria:\n\n\nAtaca al objetivo de manera instantánea, lo que le inflige (1 + Attack power * 45 / 100) p. de daño y a ti te sana un 10% de tu salud máxima. Solo se puede usar durante 20 sec después de haber matado a un enemigo que otorga experiencia u honor.\n\"Te enseña una nueva facultad de grabado.\""},
[204807] = {name = "Filobraza", additional_info = "Se liga al recogerlo\nDos manos Espada\n71 - 107 Daño Velocidad 3.60\n(24.72 daño por segundo)\nDurabilidad 100 / 100\nNecesitas ser de nivel 25\nProbabilidad al acertar: Ataca a todos los enemigos frente a ti con un estallido de agua a presión.\nEquipar: Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia.\n\"Al blandirla, se oyen los ecos de unas olas que rompen contra una orilla.\""},
[204809] = {name = "Runa de Trueno de furia", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus pantalones la runa de Trueno de furia:\n\n\nThunder Clap now increases the time between attacks by an additional 6%, can be used in any stance, deals 100% increased damage, and deals 50% increased threat.\n\"Te enseña una nueva facultad de grabado.\""},
[204864] = {name = "Notas de aprendiz de Azora", additional_info = "Se liga al recogerlo\nÚnico (6)\nUso: Combina 6 notas de aprendiz de Azora para crear una nueva receta de grabado."},
[204905] = {name = "Tomo agorero", additional_info = "Se liga al recogerlo\nÚnico\nUso: Invocar a Soboz\n\"Introduce una mandíbula de lobo y la sangre de un gnoll en el estómago del cordero. Después, comienza la encantamiento.\""},
[204906] = {name = "Sangre de gnoll", additional_info = "Único\n\"Un componente utilizado en un ritual de invocación.\""},
[204907] = {name = "Mandíbula de lobo", additional_info = "Único\n\"Un componente utilizado en un ritual de invocación.\""},
[204910] = {name = "Monster - Trident, Naga (Gold)", additional_info = "Se liga al recogerlo\nDos manos Arma de asta\n2 - 4 Daño Velocidad 3.00\n(1.00 daño por segundo)\nDurabilidad 20 / 20"},
[204912] = {name = "Runa de Gracia", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus pantalones la runa de Gracia demoníaca:\n\n\nTe sobrecarga de energía vil, lo que aumenta tu probabilidad de esquivar y la de tu mascota un 30%, y tu probabilidad de asestar golpes críticos con todos tus ataques un 30%. Dura 6 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[205019] = {name = "Fragmento de alma contaminado", additional_info = "Se liga al recogerlo\nÚnico"},
[205020] = {name = "Fragmento de alma puro", additional_info = "Se liga al recogerlo\nÚnico"},
[205022] = {name = "Runa de Succión de alma", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tu pechera o túnica la runa de Succión de alma:\n\n\nAumenta la cantidad drenada por tus hechizos Drenar vida y Drenar alma un 6% extra por cada efecto de las Sombras que hayas aplicado sobre el objetivo, hasta un máximo de un 18% de efecto extra.\n\"Te enseña una nueva facultad de grabado.\""},
[205181] = {name = "Artefacto sin identificar", additional_info = "Se liga al recogerlo\nÚnico\n\"Un objeto mágico esotérico. Un brujo con más experiencia podría contarte más sobre él.\""},
[205182] = {name = "Artefacto sin poder", additional_info = "Se liga al recogerlo\nÚnico\nUso: Ofrece tu sangre para potenciar el artefacto."},
[205183] = {name = "Artefacto de poder vil", additional_info = "Se liga al recogerlo\nÚnico"},
[205184] = {name = "Nota del acólito", additional_info = "Se liga al recogerlo\nÚnico\n<Click derecho para leer>"},
[205215] = {name = "Runa de tácticas", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tu pechera o túnica la runa de Tácticas demoníacas:\n\n\nAumenta un 10% tu probabilidad de golpe crítico cuerpo a cuerpo y tu probabilidad de golpe crítico con hechizos, así como las de tu mascota.\n\"Te enseña una nueva facultad de grabado.\""},
[205218] = {name = "Tratado de descubrimiento", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tratado\nClases: Paladín\nNecesitas ser de nivel 5\nGrabas en tu pechera o túnica la runa de Succión de alma:\n\n\nAumenta la cantidad drenada por tus hechizos Drenar vida y Drenar alma un 6% extra por cada efecto de las Sombras que hayas aplicado sobre el objetivo, hasta un máximo de un 18% de efecto extra.\n\"Consigue un estado de inspiración asesinando a 5 enemigos y luego úsalo para aprender una nueva facultad.\""},
[205228] = {name = "Runa de Descarga de caos", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus guantes la runa de Descarga de caos:\n\n\nLanza una descarga de fuego caótico al enemigo que le inflige entre (* 522 / 100) y (* 662 / 100) p. de daño de Fuego. Descarga de caos siempre acierta, no se puede resistir y, si la conoces, hace que tus hechizos de Fuego atraviesen todos los efectos de absorción. Existen muchas probabilidades de que Descarga de caos se resista cuando se usa contra monstruos de 4 niveles o más que el tuyo.\n\"Te enseña una nueva facultad de grabado.\""},
[205230] = {name = "Runa de Tormento", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus guantes la runa de Poseer:\n\n\nLiberas un alma fantasmal sobre un enemigo, que le inflige entre (* 251 / 100) y (* 295 / 100) de daño y aumenta todo el daño de las Sombras en el tiempo que infliges a ese objetivo un 20%. Cuando el efecto de Poseer termina o se disipa, te sana la misma cantidad de daño que ha infligido a tu objetivo.\n\"Te enseña una nueva facultad de grabado.\""},
[205364] = {name = "Morral del acólito", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\n<Click derecho para abrir>"},
[205420] = {name = "Tratado de sentencia", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tratado\nClases: Paladín\nGrabas en tus guantes la runa de Golpe de cruzado:\n\n\nUn golpe instantáneo que inflige un 75% de daño con arma y regenera un 5% de tu maná máximo.\n\"Aprendes una nueva facultad tras liberar la energía de 10 sellos sobre tus enemigos.\""},
[205683] = {name = "Runa de Reprimenda", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tus pantalones la runa\n de Reprimenda:\n\n\nInterrumpe el lanzamiento de hechizos y evita que se puedan lanzar hechizos de esa misma escuela durante 3 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[205685] = {name = "Runa de Égida", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tu pechera la runa de Égida:\n\n\nAumenta tu valor de bloqueo un 30%, y los ataques cuerpo a cuerpo y a distancia que te alcancen tienen un 10% de probabilidad de aumentar tu probabilidad de bloqueo un 30%. Dura 10 sec o 5 bloqueos. Este efecto no se puede combinar con Baluarte.\n\"Te enseña una nueva facultad de grabado.\""},
[205863] = {name = "Tratado corrupto", additional_info = "Clases: Paladín"},
[205864] = {name = "Nota chamuscada", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\n<Click derecho para leer>"},
[205897] = {name = "Runa de Martirio", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tu pechera la runa de Sello de martirio:\n\n\nTe colma con el espíritu sagrado durante 30 sec, lo que hace que tus ataques cuerpo a cuerpo inflijan un 40% de daño con arma a tu objetivo, pero pierdes una cantidad de salud equivalente a un 10% del daño infligido. Mientras el sello está activo, los miembros de tu grupo y banda que se encuentran en un radio de 40 m ganan una cantidad de maná equivalente a un 20% del daño que recibes de este sello.\n\n Al liberar la energía de este sello, un enemigo resulta juzgado y recibe al instante un 70% de daño con arma con un coste de salud equivalente al 10% del daño infligido.\n\"Te enseña una nueva facultad de grabado.\""},
[205905] = {name = "Recuerdo de un campeón devoto", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tu pechera o túnica la runa de Fe retorcida:\n\n\nTortura mental y Explosión mental infligen un 50% más de daño a los objetivos afectados por tu Palabra de las Sombras: dolor.\nUso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[205932] = {name = "Profecía sobre la muerte de un rey", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus guantes la runa de Palabra de las Sombras: muerte:\n\n\nUna palabra de vínculo oscuro que inflige de (* 532 / 100) a (* 620 / 100) p. de daño de las Sombras al objetivo. Si el objetivo no muere por Palabra de las Sombras: muerte, el taumaturgo recibe una cantidad de daño igual a un 50% daño infligido a este.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth."},
[205940] = {name = "Recuerdo de un oscuro propósito", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tu pechera o túnica la runa de Plaga del Vacío:\n\n\nProvoca al objetivo una enfermedad que le inflige (* 117 / 100 * 6) p. de daño de las Sombras durante 18 sec.\nUso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[205942] = {name = "Epifanía quimérica", additional_info = "Grabas en tus pantalones la runa de Rezo de alivio:\n\n\nLanza un hechizo sobre el objetivo que le sanará (* 74 / 100) p. la próxima vez que reciba daño o sanación. Una vez curado, Rezo de alivio saltará a otro miembro del grupo o banda que se encuentre en un radio de 20 m. Salta hasta 5 veces y dura 30 sec tras cada salto. Este hechizo solo puede estar activo en un único objetivo a la vez."},
[205943] = {name = "Profecía sobre una ciudadela profanada", additional_info = "Único\nGrabas en tus pantalones la runa de Homúnculos:\n\n\nCrea unos fragmentos de tu alma que animan 3 copias tuyas en miniatura. Estas intentan atacar a tu objetivo actual con una maza, una espada y un hacha, lo que reduce la velocidad de ataque, el poder de ataque y la armadura, respectivamente, de cualquier objetivo al que golpeen.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth."},
[205944] = {name = "Epifanía recíproca", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus pantalones la runa de Rezo de alivio:\n\n\nLanza un hechizo sobre el objetivo que le sanará (* 74 / 100) p. la próxima vez que reciba daño o sanación. Una vez curado, Rezo de alivio saltará a otro miembro del grupo o banda que se encuentre en un radio de 20 m. Salta hasta 5 veces y dura 30 sec tras cada salto. Este hechizo solo puede estar activo en un único objetivo a la vez.\n\"Aprendes una nueva facultad de grabado.\""},
[205945] = {name = "Recuerdo de un salvador encarcelado", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus pantalones la runa de Dolor compartido:\n\n\nAhora, tu Palabra de las Sombras: dolor afecta a un máximo de 2 objetivos cercanos más en un radio de 15 m.\nUso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[205946] = {name = "Recuerdo de la traición de un líder", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus botas la runa de Supresión de dolor:\n\n\nReduce instantáneamente todo el daño recibido por un objetivo amistoso un 40% y aumenta la resistencia a la disipación un 65% durante 8 sec.\nUso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[205947] = {name = "Profecía sobre una ciudadela profanada", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus pantalones la runa de Homúnculos:\n\n\nCrea unos fragmentos de tu alma que animan 3 copias tuyas en miniatura. Estas intentan atacar a tu objetivo actual con una maza, una espada y un hacha, lo que reduce la velocidad de ataque, el poder de ataque y la armadura, respectivamente, de cualquier objetivo al que golpeen.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth."},
[205948] = {name = "Epifanía anodina", additional_info = nil},
[205949] = {name = "Epifanía múltiple", additional_info = "Grabas en tus guantes la runa de Círculo de sanación:\n\n\nSana de (* 130 / 100) a(* 144 / 100) p. a todos los miembros del grupo del jugador objetivo en un radio de 40 m."},
[205950] = {name = "Epifanía tenebrosa", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus guantes la runa de Abrasamiento mental:\n\n\nProvoca una deflagración de magia de las Sombras alrededor del objetivo enemigo, lo que inflige de (70 / 100 *) a (78 / 100 *) p. de daño de las Sombras cada 1 s durante 5 sec a todos los enemigos en un radio de 10 m alrededor del objetivo.\n\"Aprendes una nueva facultad de grabado.\""},
[205951] = {name = "Recuerdo de un acólito preocupado", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus guantes la runa de Penitencia:\n\n\nLanza una salva de luz Sagrada al objetivo que inflige (* 128 / 100) p. de daño Sagrado a un enemigo o aplica (* 85 / 100) p. de sanación a un aliado de forma instantánea y cada 1 s durante 2 sec.\nUso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[205952] = {name = "Recuerdo de un mundo destrozado", additional_info = "Uso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[205953] = {name = "Profecía sobre un juramento roto", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tu cinturón la runa de Púa mental:\n\n\nGolpea al objetivo, inflige de (111 */ 100) p. a (129 */ 100) p. de daño de Fríosombra y aumenta un 30% la probabilidad de golpe crítico de la siguiente Explosión mental que lances al objetivo. Se acumula hasta 3 veces.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth."},
[205961] = {name = "Carne de ave de Mulgore", additional_info = "Único\nUso: Colocas cebo cerca de la morada de un puma."},
[205979] = {name = "Runa de flanco", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus pantalones la runa de Golpe de flanco:\n\n\nTu mascota y tú infligís simultáneamente un 100% de daño cuerpo a cuerpo. Después, tu Mordedura de mangosta y tu Golpe de raptor infligen un 10% más de daño durante 10 sec. Se acumula hasta 3 veces. Golpe de raptor tiene un 20% de probabilidad de restablecer el tiempo de reutilización de Golpe de flanco.\n\"Te enseña una nueva facultad de grabado.\""},
[205995] = {name = "Almizcle de perro de la pradera", additional_info = "Clases: Cazador\nUso: Tu facultad Domesticar bestia también funciona con perros de la pradera (como mascota de compañía). (10 Min Reutilización)"},
[206032] = {name = "Runa de Trinchar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus guantes la runa de Trinchar:\n\n\nUn ataque de barrido que golpea a todos los enemigos situados frente a ti e inflige un 50% de daño con arma.\n\"Te enseña una nueva facultad de grabado.\""},
[206155] = {name = "Runa de Puntería", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tu pechera o túnica la runa de Maestro tirador:\n\n\nAumenta 5% tu probabilidad de golpe crítico y reduce un 25% el coste de maná de todas tus facultades de disparo.\n\"Te enseña una nueva facultad de grabado.\""},
[206157] = {name = "Carga de seforio de minería", additional_info = "Objeto de misión\nÚnico (5)"},
[206159] = {name = "Disfraz de Ventura y Cía.", additional_info = "Objeto de misión\n\"No parece un buen disfraz...\""},
[206168] = {name = "Runa de la quimera", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus guantes la runa de Disparo de quimera:\n\n\nInfliges un 100% de daño con arma, reinicias la Picadura actual sobre tu objetivo y activas un efecto:\n\n Picadura de serpiente: inflige instantáneamente un 40% del daño infligido por tu Picadura de serpiente.\n\n Picadura de víbora: te restaura instantáneamente el equivalente a un 60% de la cantidad de maná drenada por tu Picadura de víbora.\n\n Picadura de escórpido: intenta desarmar al objetivo durante 10 sec. Este efecto no puede tener lugar más de una vez por minuto.\n\"Te enseña una nueva facultad de grabado.\""},
[206169] = {name = "Runa de Disparo explosivo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus guantes la runa de Disparo explosivo:\n\n\nLanzas una carga explosiva al objetivo que inflige de (Ranged attack power * 0.039 + 36 / 100 *) a (Ranged attack power * 0.039 + 54 / 100 *) p. de daño de Fuego a todos los enemigos en un radio de 8 m. La carga infligirá daño al objetivo de nuevo cada segundo durante 2 sec más.\n\"Te enseña una nueva facultad de grabado.\""},
[206170] = {name = "Bellota Viento Furioso", additional_info = "Objeto de misión"},
[206175] = {name = "Ungüento de pino", additional_info = "Objeto de misión\nÚnico"},
[206176] = {name = "Mortero y majadero", additional_info = "Objeto de misión\nÚnico\nUso: Muele 8 bellotas Viento Furioso para crear un ungüento para armas venenoso. En teoría."},
[206177] = {name = "Mantequilla de piñones", additional_info = "Se liga al recogerlo\nUso: Restaura 61.2 p. de salud durante 18 sec. Debes permanecer sentado mientras comes. Si comes durante al menos 10 segundos, estarás bien alimentado y ganarás 2 p. de aguante y espíritu durante 15 min."},
[206264] = {name = "Runa de Inspiración", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tus pantalones la runa de Inspiración ejemplar:\n\n\nTu presencia inspiradora disipa periódicamente los efectos de miedo y sueño que afectan a miembros del grupo cercanos.\n\"Te enseña una nueva facultad de grabado.\""},
[206344] = {name = "Juego de cuchillos", additional_info = "Objeto de misión\nÚnico\nUso: Intenta filetear un pececito luminoso crudo."},
[206345] = {name = "Trozos de pescado", additional_info = "Objeto de misión\nÚnico"},
[206376] = {name = "Icono de baluarte", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tu pechera o túnica la runa de Maestría con escudos:\n\n\nCada vez que bloqueas, regeneras una cantidad de maná equivalente a un 8% de tu maná máximo y obtienes armadura equivalente a un 30% del valor de armadura de tu escudo. Se acumula hasta 5 veces. Además, siempre aumentas un 10% la probabilidad de bloqueo y un 15% el valor de bloqueo.\n\"Aprendes una nueva facultad tras golpear 25 veces a tus enemigos con Arma Muerdepiedras.\""},
[206381] = {name = "Icono diádico", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tu pechera o túnica la runa de Sobrecarga:\n\n\nOtorga a tus hechizos Descarga de relámpagos, Cadena de relámpagos, Sanación en cadena, Ola de sanación y Ráfaga de lava un 50% de probabilidad de lanzar un segundo hechizo similar sobre el mismo objetivo sin coste extra, que inflige la mitad de daño o sanación y no genera amenaza.\n\"Aprendes una nueva facultad tras recibir daño de Naturaleza 10 veces.\""},
[206382] = {name = "Icono de tempestad", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 20\nGrabas en tus guantes la runa de Escudo de agua:\n\n\nEl taumaturgo queda rodeado por 3 esferas de agua que otorgan un 1% del maná máximo cada 5 s. Cada hechizo o ataque cuerpo a cuerpo o a distancia que golpee al taumaturgo restaura un 4% del maná máximo y consume una de las esferas. Solo se activará una esfera cada varios segundos. Dura 10 min. Un chamán solo puede tener un Escudo elemental activo a la vez.\n\"Aprendes una nueva facultad tras golpear a 10 enemigos que no sean jugadores con 3 elementos diferentes (Naturaleza, Escarcha y Fuego).\""},
[206383] = {name = "Icono lítico", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tus pantalones la runa de Escudo de tierra:\n\n\nProtege al objetivo con un escudo de tierra que reduce el tiempo perdido de lanzamiento o canalización cuando recibe daño un 30% y hace que los ataques sanen al objetivo escudado 100 p. Este efecto solo puede tener lugar cada pocos segundos. 3 cargas. Dura 10 min. Escudo de tierra solo puede utilizarse con un objetivo a la vez y solo puede haber un escudo elemental activo a la vez sobre el objetivo.\n\"Aprendes una nueva facultad tras bloquear 20 ataques con tu escudo.\""},
[206384] = {name = "Icono astral", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\n\"Aprendes una nueva facultad tras golpear 25 veces a tus enemigos con Arma Muerdepiedras.\""},
[206385] = {name = "Icono clástico", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tus pantalones la runa de Camino de la tierra:\n\n\nCuando Arma Muerdepiedras está activa en el arma de la mano principal, generas un 50% más de amenaza, obtienes un 30% más de salud, recibes un 10% menos de daño, reduces un 6% la probabilidad de recibir golpes críticos por ataques cuerpo a cuerpo, y Choque de tierra provoca a los objetivos para que te ataquen. Además, su tiempo de reutilización es independiente del resto de hechizos de choque, pero el alcance se reduce a cuerpo a cuerpo.\n\"Aprendes una nueva facultad tras derrotar a 20 enemigos con Choque de tierra.\""},
[206386] = {name = "Icono galvánico", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tu pechera o túnica la runa de Maestría con escudos:\n\n\nCada vez que bloqueas, regeneras una cantidad de maná equivalente a un 8% de tu maná máximo y obtienes armadura equivalente a un 30% del valor de armadura de tu escudo. Se acumula hasta 5 veces. Además, siempre aumentas un 10% la probabilidad de bloqueo y un 15% el valor de bloqueo.\n\"Aprendes una nueva facultad tras derrotar 10 veces a tus enemigos con Descarga de relámpagos.\""},
[206387] = {name = "Icono kajárico", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nGrabas en tus guantes la runa de Ráfaga de lava:\n\n\nLanzas al objetivo lava fundida que inflige entre (469 / 100 *) y (605 / 100 *) p. de daño de Fuego. Si el objetivo tiene tu Choque de llamas, Ráfaga de lava asestará un golpe crítico.\n\"Aprendes una nueva facultad tras recibir daño de la lava 5 veces. (Reduce el daño de fuentes de lava).\""},
[206388] = {name = "Icono sulfuroso", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tus guantes la runa de Explosión de arrabio:\n\n\nGolpea a un máximo de 4 enemigos que se encuentran en un cono frente a ti, que reciben de (* 72 / 100 + 5 / 100 * Attack power) a (* 108 / 100 + 5 / 100 * Attack power) p. de daño de Fuego. Esta facultad genera una gran cantidad de amenaza. El daño periódico de Choque de llamas tiene un 10% de probabilidades de restablecer el tiempo de reutilización de Explosión de arrabio.\n\"Aprendes una nueva facultad tras derrotar a 10 enemigos con Choque de tierra.\""},
[206389] = {name = "Icono de azufre", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tu cinturón la runa de Nova de Fuego:\n\n\nTu hechizo Tótem Nova de Fuego se sustituye por Nova de Fuego, que hace que tu tótem de Fuego actual inflija daño a su alrededor.\n\"Aprendes una nueva facultad tras golpear 25 veces a tus enemigos con Arma Muerdepiedras.\""},
[206390] = {name = "Icono de ichtys", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tus guantes la runa de Escudo de agua:\n\n\nEl taumaturgo queda rodeado por 3 esferas de agua que otorgan un 1% del maná máximo cada 5 s. Cada hechizo o ataque cuerpo a cuerpo o a distancia que golpee al taumaturgo restaura un 4% del maná máximo y consume una de las esferas. Solo se activará una esfera cada varios segundos. Dura 10 min. Un chamán solo puede tener un Escudo elemental activo a la vez.\n\"Aprendes una nueva facultad tras golpear 25 veces a tus enemigos con Arma Muerdepiedras.\""},
[206391] = {name = "Icono de sizigia", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tótem\nClases: Chamán\nNecesitas ser de nivel 3\n\"Aprendes una nueva facultad tras golpear 25 veces a tus enemigos con Arma Muerdepiedras.\""},
[206466] = {name = "Corona de la pradera", additional_info = "Uso: Despertar un espíritu de las llanuras"},
[206469] = {name = "Flor de la pradera", additional_info = "Clases: Druida\nUso: Combinas 3 flores de las praderas para hacer una corona."},
[206954] = {name = "Ídolo de ira osuna", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Ídolo\nClases: Druida\nNecesitas ser de nivel 10\nGrabas en tus guantes la runa de Destrozar:\n\n\nDestroza al enemigo, le inflige un 160% de daño normal y hace que el objetivo reciba un 30% de daño extra de los efectos de sangrado y de Triturar durante 1 min. Esta facultad se beneficia de todos los efectos relacionados con Zarpa y Magullar y también los activa.\n\"Aprendes una nueva facultad tras mantener tu ira en forma de oso en 50 p. o más durante 60 segundos.\""},
[206963] = {name = "Runa de Potencial natural", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tu pechera o túnica la runa de Semilla viviente:\n\n\nCuando haces una sanación crítica a tu objetivo con cualquier hechizo de sanación, le plantas una semilla viviente con un valor equivalente al 30% de la cantidad sanada. La semilla viviente florecerá cuando ataquen al objetivo. Dura 15 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[206966] = {name = "Bulbo de hierba de sátiro", additional_info = "Se liga al recogerlo\nÚnico\n\"Un esqueje de una especie vegetal invasora.\""},
[206970] = {name = "Runa de vida", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tus pantalones la runa de Flor de vida:\n\nReduce el tiempo de reutilización global de tus facultades Rejuvenecimiento y Flor de vida 0.5 s y obtienes la facultad Flor de vida:\n\n\nSana al objetivo (4 / 100 * 7 *) p. durante 7 sec. Cuando Flor de vida completa su duración o se disipa, el objetivo se sana (57 / 100 *) p., y el druida recupera la mitad del coste del hechizo. Este efecto puede acumularse hasta 3 veces sobre el mismo objetivo.\n\"Te enseña una nueva facultad de grabado.\""},
[206975] = {name = "Llave del depósito del artefacto", additional_info = "Único\n\"Abre un cofre que contiene un artefacto.\""},
[206985] = {name = "Eco del alfa", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tus botas la runa de Espíritu del alfa:\n\n\nImbuye al objetivo del espíritu de un lobo alfa, lo que aumenta un 45% toda la amenaza que genera durante 30 min. Afecta a 1 objetivo como máximo.\n\"Aprendes una nueva facultad.\""},
[206989] = {name = "Runa del Sol", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tus guantes la runa de Fuego solar:\n\n\nQuema al enemigo, lo que inflige de (130 */ 100) a (152 */ 100) p. de daño de Naturaleza y (65 * 4 */ 100) p. de daño de Naturaleza extra durante 12 sec.\n\n Además, mientras estás en forma de oso, forma felina o forma de oso temible, tu Fuego lunar se sustituye por Fuego solar (oso) o Fuego solar (gato). Este hechizo se beneficia de todos los efectos relacionados con Fuego lunar y también los activa.\n\n Fuego solar (oso)\nQuema al enemigo, lo que inflige de (130 */ 100) a (152 */ 100) p. de daño de Naturaleza y (65 * 4 */ 100) p. de daño de Naturaleza extra durante 12 sec.\n\n Fuego solar (gato)\nQuema al enemigo, lo que inflige de (130 */ 100) a (152 */ 100) p. de daño de Naturaleza y (65 * 4 */ 100) p. de daño de Naturaleza extra durante 12 sec. Otorga 1 p. de combo.\n\"Te enseña una nueva facultad de grabado.\""},
[206992] = {name = "Runa de Testarazo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"Te enseña una nueva facultad de grabado.\""},
