[207731] = {name = "Tomo agorero", additional_info = "Se liga al recogerlo\nÚnico\nUso: Invocar a Soboz\n\"Lleva una pata de makrura y la calavera de un humano de Kul Tiras a la isla más grande de las Islas del Eco. Encuentra el círculo de poder y realiza el ritual.\""},
