[208086] = {name = "Memorándum Escarlata forjado", additional_info = "Único\n\"Una escandalosa colección de reflexiones de supremacistas humanos que alarmarán a los líderes de la Alianza.\""},
[208139] = {name = "Tomo agorero", additional_info = "Se liga al recogerlo\nÚnico\nUso: Invocar a Soboz\n\"Lleva una mandíbula de lobo y la sangre de un wendigo a Monte Luz. Colócate sobre la piedra ritual y llama al demonio.\""},
