[208183] = {name = "Notas del boticario", additional_info = "Se liga al recogerlo\nÚnico (6)\nUso: Combinas 6 notas de boticario para crear una receta de grabado nueva."},
[208185] = {name = "Manual de metafísica del boticario", additional_info = "Único\n\"Apuntes básicos sobre teoría de lo Arcano e investigación sobre hechizos, reunidos por el archimago Putrevela de la Sociedad Real de Boticarios. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
