[208414] = {name = "Ídolo lunar", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Ídolo\nClases: Druida\nNecesitas ser de nivel 4\nGrabas en tu pechera o túnica la runa de Furia de Tempestira:\n\n\nReduce el coste de maná de Cólera un 100%, y cada vez que infliges daño con Cólera tienes un 12% de probabilidad de provocar que tu siguiente lanzamiento de Toque de sanación durante los siguientes 15 sec sea instantáneo.\n\"Derrota a 6 criaturas afectadas por tu Fuego lunar y después usa este ídolo para aprender una nueva facultad.\""},
