[208610] = {name = "Cabeza de búho cortada", additional_info = "Se liga al recogerlo\nÚnico\n\"Un macabro trofeo. Puede que le interese a algún coleccionista...\""},
[208611] = {name = "Cabeza de tigre cortada", additional_info = "Se liga al recogerlo\nÚnico\n\"Un macabro trofeo. Puede que le interese a algún coleccionista...\""},
[208612] = {name = "Cabeza de araña cortada", additional_info = "Se liga al recogerlo\nÚnico\n\"Un macabro trofeo. Puede que le interese a algún coleccionista...\""},
[208682] = {name = "Huevo de quijaforte abandonado", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"Necesita un nuevo hogar.\""},
[208687] = {name = "Runa de Lacerar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tus guantes la runa de\n Lacerar:\n\n\nLacera al objetivo enemigo y le inflige (* 20 / 100 * 5) p. de daño de sangrado durante 15 sec más un 20% de daño de arma por cada aplicación de Lacerar sobre el objetivo. Genera una gran cantidad de amenaza. El efecto se acumula hasta 5 veces en un mismo objetivo.\n\"Te enseña una nueva facultad de grabado.\""},
[208689] = {name = "Ídolo de ferocidad", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Ídolo\nClases: Druida\nNecesitas ser de nivel 20\nGrabas en tus pantalones la runa de Rugido salvaje:\n\n\nRemate que aumenta el daño físico infligido en forma felina un 30%. Se prolonga por cada punto de combo:\n 1 p.: 14 s\n 2 p.: 19 s\n 3 p.: 24 s\n 4 p.: 29 s\n 5 p.: 34 s\n\"Inflige daño de sangrado 20 veces a humanoides y después usa este ídolo para aprender una nueva facultad.\""},
[208701] = {name = "Runa de Maestría en bestias", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus guantes la runa de Maestría en bestias:\n\n\nEl daño y la salud de tu mascota aumentan un 20% y su regeneración de enfoque aumenta un 50%. Además, el Bramido de tu mascota también provoca al objetivo para que la ataque durante 3 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[208739] = {name = "Estandarte de guerra de la Horda", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\n\"Planta este estandarte en suelo enemigo.\""},
[208741] = {name = "Runa de Ira interminable", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus guantes la runa de Ira interminable:\n\n\nGeneras un 25% más de ira con todo el daño que infliges.\n\"Te enseña una nueva facultad de grabado.\""},
[208743] = {name = "Alma de codicia", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo"},
[208744] = {name = "Runa de descargas de las Sombras", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus guantes la runa de Salva de descarga de las Sombras:\n\n\nTu Descarga de las Sombras ahora golpea a un máximo de 5 objetivos a una distancia de 10 m entre sí, pero su daño se reduce un 20%.\n\"Te enseña una nueva facultad de grabado.\""},
[208749] = {name = "Llave del alijo Tuercepinos", additional_info = "Único\n\"Hay una rama tallada toscamente en el mango.\""},
[208750] = {name = "Runa de canalización", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tu pechera o túnica la runa de Maestro canalizador:\n\n\nTu Drenar vida ya no se canaliza, dura 15 sec y tiene un tiempo de reutilización de 15 sec, cuesta un 100% más de maná y te cura un 50% más cada vez que inflige daño.\n\"Te enseña una nueva facultad de grabado.\""},
[208753] = {name = "Notas sobre hechizos: Regeneración", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tu pechera o túnica la runa de Regeneración:\n\n\nSana (* 42 / 100 * 3) p. de salud durante 3 sec al objetivo y le aplica Baliza temporal durante 30 s.\n\n Baliza temporal\n\nRegistra la posición espaciotemporal del sujeto. Un 80% de todo el daño Arcano infligido por el taumaturgo se convierte en sanación cronomántica sobre cada uno de los objetivos actuales de su Baliza temporal. La sanación se reduce un 50% sobre uno mismo, y un 80% cuando se inflige daño con hechizos Arcanos que afectan a varios objetivos.\n\"Teaches you a new Engraving ability.\""},
[208754] = {name = "Notas sobre hechizos: RAGENÓNERICE", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nUso: Descifra las notas sobre hechizos con un amuleto de comprensión para aprender un nuevo hechizo de grabado."},
[208758] = {name = "Runa terránea", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nGrabas en tus pantalones la runa de Camino de la tierra:\n\n\nCuando Arma Muerdepiedras está activa en el arma de la mano principal, generas un 50% más de amenaza, obtienes un 30% más de salud, recibes un 10% menos de daño, reduces un 6% la probabilidad de recibir golpes críticos por ataques cuerpo a cuerpo, y Choque de tierra provoca a los objetivos para que te ataquen. Además, su tiempo de reutilización es independiente del resto de hechizos de choque, pero el alcance se reduce a cuerpo a cuerpo.\n\"Te enseña una nueva facultad de grabado.\""},
[208760] = {name = "Corona del claro", additional_info = "Uso: Despertar un espíritu de las llanuras"},
[208764] = {name = "Runa de la mente", additional_info = "Único\nClases: Sacerdote\nGrabas en tu cinturón la runa de Púa mental:\n\n\nGolpea al objetivo, inflige de (111 */ 100) p. a (129 */ 100) p. de daño de Fríosombra y aumenta un 30% la probabilidad de golpe crítico de la siguiente Explosión mental que lances al objetivo. Se acumula hasta 3 veces."},
[208765] = {name = "Mano amiga", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\n\"La mano se abrirá ante un salvador.\""},
[208766] = {name = "Mano amiga", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\n\"La mano se ha abierto ante ti.\"\n<Click derecho para abrir>"},
[208767] = {name = "Runa de Aliviar", additional_info = "Único\nClases: Sacerdote\nGrabas en tus pantalones la runa de Rezo de alivio:\n\n\nLanza un hechizo sobre el objetivo que le sanará (* 74 / 100) p. la próxima vez que reciba daño o sanación. Una vez curado, Rezo de alivio saltará a otro miembro del grupo o banda que se encuentre en un radio de 20 m. Salta hasta 5 veces y dura 30 sec tras cada salto. Este hechizo solo puede estar activo en un único objetivo a la vez.\n\"Te enseña una nueva facultad de talla de runas.\""},
[208768] = {name = "Caja de cerillas de bucanero", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\n\"Se usa para prender fuego a materiales inflamables.\""},
[208771] = {name = "Runa de Danza de hojas", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus pantalones la runa de Danza de hojas:\n\n\nRemate que aumenta tu probabilidad de parada un 10%. Se prolonga por cada punto de combo:\n\n 1 p.: 14 s\n 2 p.: 18 s\n 3 p.: 22 s\n 4 p.: 26 s\n 5 p.: 30 s\n\"Te enseña una nueva facultad de grabado.\""},
[208772] = {name = "Runa de Tajo de sable", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus guantes la runa de Tajo de sable:\n\n\nDesgarras al enemigo con malicia, le infliges un 100% de daño con arma y le provocas una herida sangrante que le inflige (Attack power * 5 / 100) p. de daño cada 2 s durante 12 sec. Se acumula hasta 3 veces. Otorga 1 p. de combo.\n\n Tajo de sable se beneficia de todos los talentos y efectos que activa o modifica Golpe siniestro.\n\"Te enseña una nueva facultad de grabado.\""},
[208773] = {name = "Arpón de pesca", additional_info = "Se liga al recogerlo\nClases: Guerrero , Cazador\nUso: Lanzas un arpón a un objetivo en un radio de 40 m.\n\"¡Imprescindible para cualquiera que quiera convertirse en cazatiburones!\""},
[208777] = {name = "Runa del francotirador", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus pantalones la runa de Instrucción de francotirador:\n\n\nTus facultades de disparo tienen un 10% más de probabilidad de obtener un golpe crítico si no te has movido durante 6 s.\n\"Te enseña una nueva facultad de grabado.\""},
[208778] = {name = "Runa de Golpe rápido", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus guantes la runa de Golpe rápido:\n\n\nUn temerario ataque cuerpo a cuerpo instantáneo con tu arma a dos manos que inflige entre (Attack power * 10 / 100) y (Attack power * 20 / 100) de daño físico. Esta facultad se beneficia de todos los efectos relacionados con Golpe heroico y también los activa.\n\"Te enseña una nueva facultad de grabado.\""},
[208799] = {name = "Notas sobre hechizos: Bomba viva", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tus guantes la runa de Bomba viva:\n\n\nEl objetivo se convierte en una bomba viva y recibe (* 85 / 100 * 4) p. de daño de Fuego durante 12 sec. Después de 12 sec o cuando se disipa el hechizo, explota e inflige (* 171 / 100) p. de daño de Fuego a todos los enemigos en un radio de 10 m.\n\"Te enseña una nueva facultad de grabado.\""},
[208800] = {name = "Baxtan: Sobre la magia destructiva", additional_info = "Único\n\"Escritos de un importante goblin mago. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[208823] = {name = "Moneda de ofrenda", additional_info = "Se liga al recogerlo\nClases: Sacerdote\nUso: La lanzas a un pozo cercano para pedir un deseo."},
[208828] = {name = "Recuerdo de un juramento roto", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tu cinturón la runa de Púa mental:\n\n\nGolpea al objetivo, inflige de (111 */ 100) p. a (129 */ 100) p. de daño de Fríosombra y aumenta un 30% la probabilidad de golpe crítico de la siguiente Explosión mental que lances al objetivo. Se acumula hasta 3 veces.\nUso: Te concentras en un recuerdo para aprender un nuevo hechizo. Requiere una mente despejada tras meditar sobre los misterios espirituales de Azeroth."},
[208833] = {name = "Pastel malévolo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\n\"Este postre tiene una energía siniestra.\""},
[208838] = {name = "Arcón Hierro Negro", additional_info = "Se liga al recogerlo\nÚnico\nCerrado\n Requiere Abrir cerraduras (1)"},
[208843] = {name = "Tótem de batalla", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nUso: Desafías a un tauren a un duelo.\n\"Un símbolo de hostilidad entre los miembros de la Horda.\""},
[208847] = {name = "Geoda con forma de cráneo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\n\"Se podría partir y abrir con un golpe contundente.\""},
[208848] = {name = "Geoda con forma de cráneo rajada", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\n\"Alguien ha partido y abierto esta geoda.\"\n<Click derecho para abrir>"},
[208849] = {name = "Tratado de bendiciones", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tratado\nClases: Paladín\nNecesitas ser de nivel 4\nGrabas en tu pechera la runa de Cuerno de Lordaeron:\n\n\nEl paladín sopla el Cuerno de Lordaeron, lo que aumenta 6 p. la fuerza y la agilidad de todos los miembros del grupo en un radio de 30 m. Dura 2 min. Incompatible con Bendición del poderío.\n\"Aprendes una nueva facultad tras bendecir a 5 jugadores distintos.\""},
[208851] = {name = "Tratado de justicia", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tratado\nClases: Paladín\nNecesitas ser de nivel 8\nGrabas en tus guantes la runa de Mano de expiación:\n\n\nProvoca al objetivo para que te ataque, pero no tiene efecto si ya te está atacando.\n\n Cuando conoces esta facultad, el bonus de amenaza de Furia recta aumenta un 80% y Furia recta hace que, al recibir una sanación, obtengas una cantidad de maná equivalente a un 25% de la cantidad sanada. Además, mientras Furia recta está activa, reduce un 35% todo el daño recibido que reduzca tu salud por debajo de un 20%. Furia recta permanecerá activa hasta que se cancele.\n\"Aprendes una nueva facultad tras matar a 10 enemigos aturdidos por Martillo de Justicia.\""},
[208853] = {name = "Notas sobre hechizos: Congelación cerebral", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nRequiere\nGrabado\n(1)\nGrabas en tus botas la runa de Congelación cerebral:\n\n\nTus hechizos de daño de Escarcha con efectos escalofriantes tienen un 15% de probabilidad de hacer que tu siguiente Bola de Fuego, Descarga de Fríoarcano o Descarga de Pirofrío sea de lanzamiento instantáneo y no cueste maná.\n\"Te enseña una nueva facultad de talla de runas.\""},
[208854] = {name = "Notas sobre hechizos masticadas", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nUso: Descifra las notas sobre hechizos con un amuleto de comprensión para aprender un nuevo hechizo de grabado.\n\"Los chamanes trogg son voraces lectores.\""},
[208855] = {name = "Carnada de atún blanco arco iris", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nUso: Da de comer carnaza al objetivo.\n\"Un manjar para monstruos que viven en lagos.\""},
[208860] = {name = "Rumi de Gnomeregan: Obras completas", additional_info = "Único\n\"Escritos de un importante gnomo mago. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[209027] = {name = "Bocaditos de cangrejo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador , Druida\nUso: Da de comer una chuchería al objetivo.\n\"Los fúrbolgs atrapan correarrecifes jóvenes con ellos.\""},
[209028] = {name = "Notas sobre hechizos: BAVOB MIVA", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nUso: Descifra las notas sobre hechizos con un amuleto de comprensión para aprender un nuevo hechizo de grabado."},
[209029] = {name = "Mensaje de Emily", additional_info = "Se liga al recogerlo\nClases: Pícaro\n<Click derecho para leer>"},
[209030] = {name = "Llave del alijo de equipo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro"},
[209031] = {name = "Sobre discreto", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\n<Click derecho para abrir>"},
[209041] = {name = "Semillas de calabaza mágicas", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nUso: Plantar semillas de calabaza\n\"Necesitan tierra y fertilizante especiales para crecer.\""},
[209042] = {name = "Harina de hueso sospechosa", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"¡Nutritiva y apestosa a partes iguales! Sirve como fertilizante.\""},
[209043] = {name = "Muestra de tierra fértil", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"Recogida por alguien que sabe mucho de tierra.\""},
[209045] = {name = "Alma del mar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero , Brujo"},
[209047] = {name = "Arpón nudoso", additional_info = "Se liga al recogerlo\nClases: Guerrero , Cazador\nUso: Lanzas un arpón a un objetivo en un radio de 40 m.\n\"Solo la sangre del trillador más grande saciará su sed.\""},
[209056] = {name = "Piezas de repuesto de segador", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago , Brujo\nUso: Combinas piezas de repuesto de una segadora con un núcleo elemental para crear un prototipo de motor."},
[209057] = {name = "Prototipo de motor", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago , Brujo\nUso: Instalas un motor en un prototipo de segadora de cosecha."},
[209058] = {name = "Núcleo elemental", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago , Brujo\nUso: Combinas piezas de repuesto de una segadora con un núcleo elemental para crear un prototipo de motor."},
[209059] = {name = "Anca de dentosangre", additional_info = "Único\nClases: Cazador\nUso: Colocas un cebo cerca de la morada de un coyote."},
[209418] = {name = "Armadura tortuga de adamantita", additional_info = "Se liga al recogerlo\nPecho Malla\n338 armadura\n+11 aguante\nDurabilidad 120 / 120\nNecesitas ser de nivel 25"},
[209420] = {name = "Branquiflagelo", additional_info = "Se liga al recogerlo\nMano principal Maza\n18 - 34 Daño Velocidad 2.60\n(10.00 daño por segundo)\nDurabilidad 60 / 60\nClases: Guerrero\nNecesitas ser de nivel 14\n\"Un arma encantada. Se dice que recolecta las almas de los múrlocs asesinados.\""},
[209421] = {name = "Cordón de Aquanis", additional_info = "Se liga al recogerlo\nCintura Cuero\n58 armadura\n+7 agilidad\n+4 aguante\n+7 espíritu\nDurabilidad 35 / 35\nNecesitas ser de nivel 25"},
[209422] = {name = "Gargantilla de marea alta", additional_info = "Se liga al recogerlo\nCuello\n+7 fuerza\n+4 agilidad\nNecesitas ser de nivel 25"},
[209423] = {name = "Pañuelo liviano", additional_info = "Se liga al recogerlo\nEspalda\n24 armadura\n+6 intelecto\n+6 espíritu\nNecesitas ser de nivel 25"},
[209424] = {name = "Barrera de placas de caparazón", additional_info = "Se liga al recogerlo\nMano secundaria Escudo\n661 armadura\n14 bloquear\n+12 fuerza\nDurabilidad 100 / 100\nNecesitas ser de nivel 25"},
[209432] = {name = "Cincho de Ghamoo-Ra", additional_info = "Se liga al recogerlo\nCintura Tela\n27 armadura\n+8 aguante\n+8 intelecto\nDurabilidad 30 / 30\nNecesitas ser de nivel 25"},
[209436] = {name = "Mordisco de Serra'kis astillada", additional_info = "Se liga al recogerlo\nUna mano Daga\n29 - 55 Daño Velocidad 1.80\n(23.33 daño por segundo)\nDurabilidad 65 / 65\nNecesitas ser de nivel 25\nProbabilidad al acertar: Envenena al objetivo causando 4 p. de daño de Naturaleza cada 2 s durante 20 sec.\n\"Esta daga parece desgastada, pero sigue muy afilada.\""},
[209523] = {name = "Manteo de trillador brillante", additional_info = "Se liga al recogerlo\nEspalda\n24 armadura\n+6 fuerza\n+6 espíritu\nNecesitas ser de nivel 25"},
[209524] = {name = "Ataduras de Serra'kis", additional_info = "Se liga al recogerlo\nMuñeca Cuero\n75 armadura\n+6 fuerza\n+4 aguante\nDurabilidad 35 / 35\nNecesitas ser de nivel 25"},
[209525] = {name = "Talwar Aguaoscura punzante", additional_info = "Se liga al recogerlo\nMano principal Espada\n43 - 82 Daño Velocidad 2.70\n(23.15 daño por segundo)\nDurabilidad 90 / 90\nNecesitas ser de nivel 25\nProbabilidad al acertar: Lanza un golpe de Sombras al enemigo causándole 30 p. de daño de las Sombras."},
[209526] = {name = "PRUEBA Talwar Aguaoscura", additional_info = "Se liga al recogerlo\nMano principal Espada\nNecesitas ser de nivel 25\nProbabilidad al acertar: Lanza un golpe de Sombras al enemigo causándole 30 p. de daño de las Sombras.\n\"Esta arma es falsa, de mentira e inventada.\""},
[209527] = {name = "Guanteletes de batalla naga", additional_info = "Se liga al recogerlo\nManos Cuero\n94 armadura\n+6 fuerza\n+4 aguante\n+8 espíritu\nDurabilidad 35 / 35\nNecesitas ser de nivel 25"},
[209534] = {name = "Arbalesta azsh'ari", additional_info = "Se liga al recogerlo\nA distancia Ballesta\n36 - 69 Daño Velocidad 2.80\n(18.75 daño por segundo)\nDurabilidad 95 / 95\nNecesitas ser de nivel 25\nEquipar: +17 p. de poder de ataque a distancia."},
[209559] = {name = "Cachava del sabio crepuscular", additional_info = "Se liga al recogerlo\nDos manos Bastón\n51 - 78 Daño Velocidad 2.60\n(24.81 daño por segundo)\n+5 aguante\n+10 espíritu\nDurabilidad 100 / 100\nNecesitas ser de nivel 25\nEquipar: Aumenta la curación de los hechizos y los efectos hasta en 24 p."},
[209560] = {name = "Martillo de juicio recto", additional_info = "Se liga al recogerlo\nMano principal Maza\n17 - 32 Daño Velocidad 1.30\n(18.85 daño por segundo)\n50 armadura\n+3 fuerza\n+2 aguante\nDurabilidad 90 / 90\nNecesitas ser de nivel 25"},
[209561] = {name = "Vara del insomne anciano", additional_info = "Se liga al recogerlo\nDos manos Bastón\n37 - 63 Daño Velocidad 2.00\n(25.00 daño por segundo)\n+15 intelecto\n+14 espíritu\n+5 Sombras Resistencia\nDurabilidad 120 / 120\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 26 p."},
[209562] = {name = "Golpe Mortal de la Hidra", additional_info = "Se liga al recogerlo\nDos manos Espada\n87 - 132 Daño Velocidad 3.50\n(31.29 daño por segundo)\nDurabilidad 120 / 120\nNecesitas ser de nivel 25\nProbabilidad al acertar: Salpicas al objetivo con un veneno corrosivo antiguo que inflige 20 p. de daño de Naturaleza cada 3 s y reduce la armadura del objetivo 150 p. durante 15 sec."},
[209563] = {name = "Desgarracorazones naga", additional_info = "Se liga al recogerlo\nA distancia Arco\n30 - 56 Daño Velocidad 2.90\n(14.83 daño por segundo)\n+5 fuerza\nDurabilidad 80 / 80\nNecesitas ser de nivel 25"},
[209564] = {name = "Tridente de guardián", additional_info = "Se liga al recogerlo\nDos manos Arma de asta\n59 - 90 Daño Velocidad 3.00\n(24.83 daño por segundo)\n+12 agilidad\n+11 aguante\nDurabilidad 100 / 100\nNecesitas ser de nivel 25"},
[209565] = {name = "Anillo de las profundidades", additional_info = "Se liga al recogerlo\nDedo\n+6 fuerza\n+6 aguante\nNecesitas ser de nivel 25"},
[209566] = {name = "Leotardos del fiel", additional_info = "Se liga al recogerlo\nPiernas Malla\n191 armadura\n+10 fuerza\n+7 agilidad\n+9 aguante\nDurabilidad 90 / 90\nNecesitas ser de nivel 25"},
