[209849] = {name = "Crímenes contra la anatomía", additional_info = "Se liga al recogerlo\nÚnico\n\"Escrito por el doctor Krastinov. Una incorporación cuestionable a la biblioteca de cualquier coleccionista.\""},
[209850] = {name = "Runas de los reyes hechiceros", additional_info = "Se liga al recogerlo\nÚnico\n\"Una reliquia de los grandes imperios ogros de Draenor. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[209851] = {name = "La furia de la tierra", additional_info = "Se liga al recogerlo\nÚnico\n\"Los secretos chamanísticos mejor guardados del clan Tótem Siniestro. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[209852] = {name = "Runa de Matar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus pantalones la runa de Matar:\n\n\nDa la orden de matar, lo que aumenta el daño que inflige tu mascota con Zarpa y con Mordedura un 60% durante 30 sec. Cada Zarpa o Mordedura de la mascota reduce el bonus de daño un 20%.\n\"Te enseña una nueva facultad de grabado.\""},
[209872] = {name = "Yelmo de matadragones", additional_info = "Se liga al recogerlo\nÚnico"},
[209873] = {name = "Escudo de matadragones", additional_info = "Se liga al recogerlo\nÚnico"},
[209874] = {name = "Lanza de matadragones", additional_info = "Se liga al recogerlo\nÚnico"},
[210015] = {name = "Runa de Arremetida enfurecida", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tu pechera la runa de Arremetida enfurecida:\n\n\nUn golpe feroz que inflige un 80% de daño con arma, pero solo se puede usar si Enfurecer, Ira rabiosa o Ira sangrienta están activos.\n\"Te enseña una nueva facultad de grabado.\""},
[210026] = {name = "Símbolo del tercer búho", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"Has dominado la maestría del mar.\""},
[210043] = {name = "Símbolo del segundo búho", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"El alma de Agon por fin está en paz.\""},
[210044] = {name = "Símbolo del primer búho", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\n\"La marca de un auténtico guardián.\""},
[210045] = {name = "Sombrahoja", additional_info = "Objeto de misión"},
[210053] = {name = "Garra de lobo temible", additional_info = "Objeto de misión"},
[210055] = {name = "Huesos humanos de Trabalomas", additional_info = "Objeto de misión"},
[210056] = {name = "Tintura del despertar de la muerte", additional_info = "Objeto de misión"},
[210080] = {name = "Ofrenda vudú", additional_info = "Objeto de misión\nÚnico"},
[210137] = {name = "Runa de Crecimiento salvaje", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tus guantes la runa de Crecimiento salvaje:\n\n\nSana (34 / 100 * 7 *) p. a todos los miembros del grupo del jugador objetivo en un radio de 40 m durante 7 sec. La cantidad sanada se aplica con rapidez al principio y va disminuyendo a medida que surte efecto Crecimiento salvaje.\n\"Te enseña una nueva facultad de grabado.\""},
[210138] = {name = "Ordenanza de los Hierro Negro", additional_info = nil},
[210146] = {name = "Turbocargador de trituradora", additional_info = nil},
[210147] = {name = "Unidad de autorreciclaje de la trituradora", additional_info = "Uso: Saquea el naufragio en busca de una trituradora para sacar piezas de repuesto."},
[210177] = {name = "Ataeric: sobre curiosidades Arcanas", additional_info = "Único\n\"Escritos de un importante archimago del Kirin Tor. Una incorporación estupenda a la biblioteca de cualquier coleccionista.\""},
[210178] = {name = "Esquema: unidad de autorreciclaje de la trituradora", additional_info = "Requiere\nIngeniería\n(135)"},
[210179] = {name = "Notas sobre hechizos: ILMEGAI SARRBES", additional_info = "Se liga al recogerlo\nÚnico\nUso: Traduces las notas sobre hechizos en una receta nueva de talla de runas. Requiere una referencia para la taquigrafía del autor."},
[210183] = {name = "Cuerno de Xelthos", additional_info = "Se liga al recogerlo\nÚnico\n\"Emite un tono suave e inquietante.\""},
[210186] = {name = "Carga de irrupción", additional_info = "Se liga al recogerlo\nÚnico\nUso: ¡Abres una puerta pesada al estilo goblin!"},
[210187] = {name = "Pedido de Ventura y Cía.", additional_info = "Se liga al recogerlo\nÚnico"},
[210188] = {name = "Pedido triturado", additional_info = "Se liga al recogerlo\nÚnico\n\"Parece que ha quedado dañado en combate.\""},
[210195] = {name = "Ídolo desequilibrado", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Ídolo\nClases: Druida\nNecesitas ser de nivel 10\nUso: Equilibras los poderes de la luna, el Sueño Esmeralda y lo salvaje para aprender una nueva facultad."},
[210209] = {name = "Llave gemela", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro"},
[210210] = {name = "Certificado de fundador de Industrias de Defensa Grizzwerks", additional_info = "\"La letra pequeña aclara que este certificado no tiene valor de mercado ni aporta privilegios legales. Si pones el dedo encima de esa parte, puede que algún comerciante lo compre.\""},
[210212] = {name = "Media llave del hermano", additional_info = "Se liga al recogerlo\nÚnico\nUso: Combinas las mitades de la llave del hermano y la hermana."},
[210213] = {name = "Media llave de la hermana", additional_info = "Se liga al recogerlo\nÚnico\nUso: Combinas las mitades de la llave del hermano y la hermana."},
[210229] = {name = "Runa de Mutilación", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus guantes la runa de Mutilar:\n\n\nAtaque instantáneo con ambas armas que inflige un 100% de daño con arma más (100 / 100 *) p. adicionales con cada arma. El daño aumenta un 20% frente a objetivos envenenados. Da 2 p. de combo.\n\n Mutilar se beneficia de todos los talentos y efectos que Puñalada activa o modifica, a no ser que se especifique algo distinto.\n\"Te enseña una nueva facultad de grabado.\""},
[210250] = {name = "Anillo de oro grabado", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n\"El grabado reza: Mientras __ ambos __ arrodíllate __ la __ en __ cementerio.\""},
[210251] = {name = "Anillo de plata grabado", additional_info = "Se liga al recogerlo\nÚnico\nDedo\n\"El grabado reza: __ llevar __ anillos __ ante __ estatua __ el __\""},
[210252] = {name = "Runa de Puyazos", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus guantes la runa de Puyazo:\n\n\nAtacas al instante con el arma de tu mano izquierda para infligir daño normal con un 100% de probabilidad de aplicar al objetivo el veneno del arma que esgrime esta. Las armas más lentas requieren un mayor uso de energía. Concede 1 p. de combo.\n\n Puyazo se beneficia de todos los talentos y efectos que activa o modifica Golpe siniestro.\n\"Te enseña una nueva facultad de grabado.\""},
[210253] = {name = "Tótem de podredumbre", additional_info = "Se liga al recogerlo\nÚnico\nUso: Llama a los espíritus de los elementos.\n\"Un tótem tradicional... Retorcido y deformado por la magia oscura, es casi irreconocible para quienes se comunican con los elementos.\""},
[210322] = {name = "Runa de Veneno", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus pantalones la runa de Envenenar:\n\n\nRemate que inflige daño de Veneno instantáneo en función de las dosis de Veneno mortal que tenga el objetivo. Tras el ataque de Envenenar, tienes un 75% de probabilidad extra de aplicar Veneno instantáneo durante 1 s más 1 s extra por cada punto de combo. Se activa una dosis por cada punto de combo:\n 1 dosis: [( * 100 / 100) * 1 + Attack power * 0.09] p. de daño\n 2 dosis: [( * 100 / 100) * 2 + Attack power * 0.18] p. de daño\n 3 dosis: [( * 100 / 100) * 3 + Attack power * 0.27] p. de daño\n 4 dosis: [( * 100 / 100) * 4 + Attack power * 0.36] p. de daño\n 5 dosis: [( * 100 / 100) * 5 + Attack power * 0.45] p. de daño\n\"Te enseña una nueva facultad de grabado.\""},
[210323] = {name = "Combinación de caja fuerte", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\n\"0-4-5-1\""},
[210329] = {name = "Mapa del tesoro de Trabalomas", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\n\"Sigue el río hacia el norte, más allá de las Montañas de Alterac. Lo que buscas yace bajo sus rápidos.\""},
[210330] = {name = "Consejo útil", additional_info = "Se liga al recogerlo\nÚnico\n\"Los buenos consejos no son baratos.\"\n<Click derecho para abrir>"},
[210410] = {name = "Cebo de sacudidor de agua dulce", additional_info = "Clases: Cazador\nUso: Lanza un cebo. (5 Min Reutilización)\n\"¡Lanza un poco por la borda para atraer a un pez bien gordo!\""},
[210499] = {name = "Hongociénaga", additional_info = "Uso: Cómetelo (bajo tu propia responsabilidad)."},
[210500] = {name = "Runa de las estrellas", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tus pantalones la runa de Oleada de estrellas:\n\n\nLanzas una oleada de energías estelares que inflige de (381 / 100 *) a (467 / 100 *) p. de daño Arcano.\n\n Oleada de estrellas activa y se beneficia de la mayoría de los talentos y efectos que activan o se benefician de Cólera o Fuego estelar.\n\"Te enseña una nueva facultad de grabado.\""},
[210534] = {name = "Ídolo de las fieras", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Ídolo\nClases: Druida\nGrabas en tu pechera o túnica la runa de Golpes descontrolados:\n\n\nMientras estás en forma felina, forma de oso o forma de oso temible, los miembros del grupo en un radio de 20 m obtienen mayor ferocidad en combate. Cada golpe cuerpo a cuerpo tiene una probabilidad del 20% de otorgar al atacante un ataque extra con un 20% de poder de ataque adicional. No tiene efecto si el miembro de grupo ya se está beneficiando de Tótem Viento Furioso.\n\"Sana 10 bestias diferentes y usa este ídolo para aprender una facultad nueva.\""},
[210568] = {name = "Filacteria decrépita", additional_info = "Se liga al recogerlo\nÚnico\n\"El artefacto desprende un aura atroz.\""},
[210569] = {name = "Runa de Flagelación", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tu pechera la runa de Flagelación:\n\n\nConsigues un bonus equivalente a un 25% del daño físico infligido durante 12 sec después de la activación de Ira sangrienta o Ira rabiosa.\n\"Te enseña una nueva facultad de grabado.\""},
[210573] = {name = "Runa de Ira acuciante", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus pantalones la runa de Consumido por la ira:\n\n\nTe enfurece, lo que provoca que inflijas un 10% más de daño cuerpo a cuerpo durante 12 sec o hasta un máximo de 12 golpes después de que superes los 80 p. de ira.\n\"Te enseña una nueva facultad de grabado.\""},
[210589] = {name = "Eco de los ancestros", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nNecesitas ser de nivel 3\nGrabas en tus pantalones la runa de Guía ancestral:\n\n\nDurante los siguientes 10 sec, un 25% de tu daño se convertirá en sanación y sanará a un máximo de 3 miembros cercanos del grupo. Además, se infligirá como daño un 100% de tu sanación al objetivo más reciente de tu Choque de llamas.\n\"Aprendes una nueva facultad de grabado.\""},
[210596] = {name = "Runa de Golpes de cobra", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tu pechera o túnica la runa de Golpes de cobra:\n\n\nTus golpes críticos con facultades de Disparo provocan que los siguientes 2 ataques especiales de tu mascota asesten un golpe crítico.\n\"Te enseña una nueva facultad de grabado.\""},
[210653] = {name = "Runa de Daga de guardamano", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tus guantes la runa de Daga de guardamano:\n\n\nGolpeas al instante con el arma de tu mano izquierda para infligir daño normal con el arma de esa mano. Aumenta un 10% tu probabilidad de parar durante 10 sec. Otorga 1 p. de combo.\n\n Daga de guardamano se beneficia de todos los talentos y efectos que activa o modifica Golpe siniestro.\n\"Te enseña una nueva facultad de grabado.\""},
[210654] = {name = "Notas sobre hechizos: Retroceder en el tiempo", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tus guantes la runa de Retroceder en el tiempo:\n\n\nEl objetivo actual de Baliza temporal se sana al instante todo el daño recibido durante los últimos 5 s. No surte efecto sobre objetivos que no tuvieran una baliza temporal hace 5 s.\n\"Te enseña una nueva facultad de grabado.\""},
[210655] = {name = "Notas sobre hechizos: DEROCE POTER NELETRIEM", additional_info = "Se liga al recogerlo\nÚnico\nUso: Descifra las notas sobre hechizos con un amuleto de comprensión para aprender un nuevo hechizo de grabado."},
[210665] = {name = "Mota de ira torrencial", additional_info = "Se liga al recogerlo\nÚnico"},
[210667] = {name = "Mota de ira infernal", additional_info = "Se liga al recogerlo\nÚnico"},
[210668] = {name = "Mota de ira sísmica", additional_info = "Se liga al recogerlo\nÚnico"},
[210696] = {name = "Terror putrefacto", additional_info = "Se liga al recogerlo\nMano principal Espada\n18 - 34 Daño Velocidad 2.60\n(10.00 daño por segundo)\nDurabilidad 60 / 60\nClases: Guerrero\nNecesitas ser de nivel 14\n\"La hoja manchada de sangre ya no brilla con la luz, pero sirve de advertencia...\""},
[210708] = {name = "Elixir de arrepentimiento fusionado", additional_info = "Necesitas ser de nivel 20\nUso: Permite al objetivo hablar con el cadáver de alguien con asuntos pendientes en el mundo de los mortales. También alivia la indigestión. (3 Seg Reutilización)"},
[210709] = {name = "Receta: elixir de arrepentimiento fusionado", additional_info = "Requiere\nAlquimia\n(90)\nUso: Te enseña a hacer un elixir de arrepentimiento fusionado.\nElixir de arrepentimiento fusionado\nNecesitas ser de nivel 20\nUso: Permite al objetivo hablar con el cadáver de alguien con asuntos pendientes en el mundo de los mortales. También alivia la indigestión. (3 Seg Reutilización)\nRequiere Alga estranguladora (5), Vial con plomo , Moho de tumba (5), Polvo de alma"},
[210712] = {name = "Elixir de perspicacia", additional_info = "Se liga al recogerlo\nUso: Observa una visión en la hoguera de Je'neu."},
[210713] = {name = "Alma torturada", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nUso: Realiza una ofrenda de sangre para liberar a esta alma torturada."},
[210724] = {name = "Bastón de Hirzek", additional_info = "Se liga al recogerlo"},
[210741] = {name = "Moledora automática de muchedumbres", additional_info = "Se liga al recogerlo\nDos manos Maza\n53 - 85 Daño Velocidad 2.00\n(34.50 daño por segundo)\n+22 fuerza\n+8 agilidad\nDurabilidad 100 / 100\nClases: Paladín , Chamán , Druida\nNecesitas ser de nivel 40\nEquipar: +69 p. de poder de ataque solo en las formas de oso, oso temible y felina.\nUso: Aumenta tu velocidad de ataque en un 50% durante 30 sec. (3 Min Reutilización)\n\"Se han implementado muchas actualizaciones para mejorar el uso del modelo de este año.\""},
[210746] = {name = "Runa de Escudo de tierra", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nGrabas en tus pantalones la runa de Escudo de tierra:\n\n\nProtege al objetivo con un escudo de tierra que reduce el tiempo perdido de lanzamiento o canalización cuando recibe daño un 30% y hace que los ataques sanen al objetivo escudado 100 p. Este efecto solo puede tener lugar cada pocos segundos. 3 cargas. Dura 10 min. Escudo de tierra solo puede utilizarse con un objetivo a la vez y solo puede haber un escudo elemental activo a la vez sobre el objetivo.\n\"Te enseña una nueva facultad de grabado.\""},
[210763] = {name = "Rama de Altek", additional_info = "Se liga al recogerlo\nÚnico\n\"Un fragmento de poder astillado. Parece que esto fue la mitad de una poderosa arma.\""},
[210765] = {name = "Orbe de Des", additional_info = "Se liga al recogerlo\nÚnico\n\"Unas llamas y una magia oscura tan hipnotizadoras como perturbadoras se arremolinan en el orbe. Parece que esto fue la mitad de una poderosa arma.\""},
[210771] = {name = "Suministros saqueados: lingotes de cobre", additional_info = "Se liga al recogerlo\nÚnico: [Waylaid Shipment] (12)\nUso: Añade 20 lingotes de cobre para completar el envío."},
[210772] = {name = "Envío de suministros: lingotes de cobre", additional_info = "Se liga al recogerlo\nÚnico: [Supply Shipment] (1)\n\"Entrégalo a un oficial de suministros a cambio de una generosa recompensa.\""},
[210773] = {name = "Manto de la Segunda Guerra", additional_info = "Se liga al equiparlo\nHombro Malla\n163 armadura\n+8 aguante\nDurabilidad 70 / 70\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño causado por los hechizos Sagrados y los efectos hasta en 11 p."},
[210779] = {name = "Diseño: manto de la Segunda Guerra", additional_info = "Se liga al recogerlo\nRequiere\nHerrería\n(150)\nUso: Te enseña a crear un manto de la Segunda Guerra.\nManto de la Segunda Guerra\nSe liga al equiparlo\nHombro Malla\n163 armadura\n+8 aguante\nDurabilidad 70 / 70\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño causado por los hechizos Sagrados y los efectos hasta en 11 p.\nRequiere Lingote de bronce (20), Ágata musgosa (2), Piedra lunar inferior (2), Perla iridiscente (2), Lingote de plata (4)"},
[210781] = {name = "Ataduras de Fénix", additional_info = "Se liga al equiparlo\nMuñeca Tela\n21 armadura\nDurabilidad 30 / 30\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño causado por los hechizos de Fuego y los efectos hasta en 13 p."},
[210794] = {name = "Coraza de plata cambiante", additional_info = "Se liga al recogerlo\nÚnico-Equipado: [Void-Touched] (1)\nPecho Malla\n238 armadura\n+12 fuerza\n+5 aguante\nDurabilidad 145 / 145\nNecesitas ser de nivel 25\nRequiere\nHerrería\n(100)\nEquipar: Este objeto está imbuido del poder en bruto del Vacío. Cuando el portador sea atacado, el objeto tiene grandes probabilidades de infligir una terrible maldición que hará que el atacante reciba daño extra de todas las fuentes durante 15 s. (Probabilidad de que accione: 25%)\nEquipar: Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia."},
[210795] = {name = "Botas de seda de araña extrabidimensional", additional_info = "Se liga al recogerlo\nÚnico-Equipado: [Void-Touched] (1)\nPies Tela\n35 armadura\n+5 aguante\n+5 intelecto\n+6 espíritu\nDurabilidad 50 / 50\nNecesitas ser de nivel 25\nRequiere\nCostura\n(100)\nUso: Cambia momentáneamente a otro plano de existencia, lo que reduce al instante la amenaza, todo el daño recibido y el daño causado un 30% durante 6 sec. (10 Min Reutilización)\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 7 p.\nEquipar: Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia."},
[210811] = {name = "Runa de furia primigenia", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nGrabas en tus pantalones la runa de Ira del chamán:\n\n\nReduce un 20% todo el daño que recibes y te hace regenerar maná cada segundo durante 15 sec. El maná regenerado cada segundo es igual a un 15% de tu poder de ataque, un 10% de tu poder con hechizos o un 6% de tu poder de sanación, lo que sea mayor. Los miembros de tu grupo y banda en un radio de 40 m también reciben un 20% del maná que recibes de este modo.\n\"Te enseña una nueva facultad de grabado.\""},
[210817] = {name = "Runa de supervivencia", additional_info = "Se liga al recogerlo\nÚnico\nClases: Druida\nGrabas en tu pechera o túnica la runa de Supervivencia del más fuerte:\n\n\nReduce la probabilidad de recibir un golpe crítico en ataques cuerpo a cuerpo un 6% y reduce todo el daño que recibes un 10%. Daño recibido reducido un 10% más mientras estás en forma de oso o forma de oso temible.\n\"Te enseña una nueva facultad de grabado.\""},
[210818] = {name = "Runa de lobo solitario", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tu pechera o túnica la runa de Lobo solitario:\n\n\nInfliges un 30% más de daño con todos tus ataques cuando no tienes una mascota activa.\n\"Te enseña una nueva facultad de grabado.\""},
[210820] = {name = "Runa de sacrificio", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tus pantalones la runa de Sacrificio divino:\n\n\nUn 30% de todo el daño recibido por los miembros del grupo en un radio de 30 m se redirige al paladín durante 10 sec. El daño que reduzca la salud del paladín por debajo del 20% romperá el efecto y aumentará un 10% el daño infligido y la sanación realizada durante 10 sec. No puedes usar Sacrificio divino si estás bajo los efectos de Bendición de protección, Escudo divino o Protección divina y además evita que puedas ser objetivo de dichas facultades mientras el efecto está activo.\n\"Te enseña una nueva facultad de grabado.\""},
[210822] = {name = "Epifanía armoniosa", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tu pechera o túnica la runa de Serendipia:\n\n\nSanar con Sanación relámpago reduce el tiempo de lanzamiento de tu próximo Sanación inferior, Sanar, Sanación superior o Rezo de sanación un 20% durante 20 sec. Se acumula hasta 3 veces.\n\"Aprendes una nueva facultad de grabado.\""},
[210823] = {name = "Runa de especialización en doble empuñadura", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nGrabas en tu pechera o túnica la runa de Especialización en doble empuñadura:\n\n\nAumenta tu probabilidad de golpear con hechizos y ataques cuerpo a cuerpo un 10% con doble empuñadura y tu Golpe de tormenta ahora golpea con ambas armas.\n\"Te enseña una nueva facultad de grabado.\""},
[210824] = {name = "Runa del pacto", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus pantalones la runa de Pacto demoníaco:\n\n\nLos golpes críticos de tu mascota aplican el efecto Pacto demoníaco a los miembros del grupo durante 45 sec. Pacto demoníaco aumenta el daño con hechizos y la sanación un 10% de tu daño con hechizos o (Level / 2) p., lo que sea mayor. No funciona con demonios subyugados.\n\"Te enseña una nueva facultad de grabado.\""},
[210825] = {name = "Runa del belisario", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\n\"Te enseña una nueva facultad de grabado.\""},
[210953] = {name = "Ojo de Bhossca", additional_info = "Se liga al recogerlo\nÚnico\n\"Aunque el ojo parece inanimado, sientes que te observa...\""},
[210955] = {name = "Uniforme de iniciado Escarlata", additional_info = "Se liga al recogerlo\nÚnico\nUso: Te disfrazas de miembro de La Cruzada Escarlata. Cualquier actividad sospechosa hará caer el disfraz."},
[210963] = {name = "Llave del arúspice", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro"},
[210966] = {name = "Sangre de la Legión", additional_info = "Objeto de misión\nÚnico (10)\n\"Oscura y espesa... Esta sangre está vinculada a célebres comandantes de la Legión.\""},
[210967] = {name = "Mensaje confidencial", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\n<Click derecho para leer>"},
[210968] = {name = "Llave del relicario", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro"},
[210979] = {name = "Runa de Paso de las Sombras", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tu cinturón la runa de Paso de las Sombras:\n\n\nIntentas dar un paso en las sombras y reaparecer detrás de tu enemigo, y aumentas tu velocidad de movimiento un 70% durante 3 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[210980] = {name = "Runa de Metamorfosis", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\n\"Te enseña una nueva facultad de grabado.\""},
[211205] = {name = "Runa de Corazón del león", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tu pechera o túnica la runa de Corazón del león:\n\n\nEl cazador invoca el corazón de un león, lo que aumenta un 10% las estadísticas totales de todos los aliados cercanos y un 10% más las suyas totales.\n\"Te enseña una nueva facultad de grabado.\""},
[211247] = {name = "Patrón: ataduras de Fénix", additional_info = "Se liga al recogerlo\nRequiere\nCostura\n(125)\nUso: Te enseña a confeccionar ataduras de Fénix.\nAtaduras de Fénix\nSe liga al equiparlo\nMuñeca Tela\n21 armadura\nDurabilidad 30 / 30\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño causado por los hechizos de Fuego y los efectos hasta en 13 p.\nRequiere Descarga de paño de lana (6), Botella de aceite (2), Hilo refinado (2)"},
[211263] = {name = "Coselete de sentencia", additional_info = "Se liga al recogerlo\nPecho Placas\n857 armadura\n+17 fuerza\n+25 aguante\n+20 intelecto\n+10 Fuego Resistencia\n+10 Naturaleza Resistencia\nDurabilidad 165 / 165\nClases: Paladín\nNecesitas ser de nivel 60\nEquipar: Defensa aumentada +6.\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 14 p.\nEquipar: Aumenta el valor de bloqueo de tu escudo en 32 p.\n\nBaluarte de sentencia (0/8)\nCinturón de sentencia\nAtaduras de sentencia\nCoselete de sentencia\nCorona de sentencia\nGuanteletes de sentencia\nQuijotes de sentencia\nEscarpes de sentencia\nBufas de sentencia\n(3) Conjunto : Aumenta el radio del aura del paladín en 10 p.\n(5) Conjunto : Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 47 p.\n(8) Conjunto : Inflige un daño Sagrado adicional de 60 to 66 p. al objetivo de una Sentencia de paladín."},
