[211365] = {name = "Envío de suministros", additional_info = "Se liga al recogerlo\n\"Entrégalo a un oficial de suministros a cambio de una generosa recompensa.\""},
[211367] = {name = "Envío de suministros", additional_info = "Se liga al recogerlo\n\"Entrégalo a un oficial de suministros a cambio de una generosa recompensa.\""},
