[211384] = {name = "Bolsa de mensajero resistente", additional_info = "Se liga al recogerlo\nÚnico\nBolsa de 12 casillas"},
[211385] = {name = "Runa de Propagar serpientes", additional_info = "Se liga al recogerlo\nÚnico\nClases: Cazador\nGrabas en tus pantalones la runa de Propagar serpientes:\n\n\nLos objetivos golpeados por tu Multidisparo también se ven afectados por tu Picadura de serpiente durante 6 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[211386] = {name = "Notas sobre hechizos: Oleada Arcana", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tus pantalones la runa de Oleada Arcana:\n\n\nLanzas todo el maná que te queda en una oleada de energía centrada en el objetivo que le inflige de (* 226 / 100) a (* 264 / 100) p. de daño Arcano. El daño aumenta un 300% en función del maná que te quede. Después se activa tu regeneración de maná normal, que aumenta un 300% durante 8 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[211387] = {name = "Runa de Luz atrayente", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tus guantes la runa de Señal de la Luz:\n\n\nEl objetivo se convierte en una Señal de la Luz para todos los miembros de tu grupo o banda que se encuentren en un radio de 40 m. Cualquier sanación que lances sobre miembros de tu grupo o banda sanará también a la señal un 100% de la cantidad sanada. Solo un objetivo puede ser la Señal de la Luz cada vez. Dura 1 min.\n\"Te enseña una nueva facultad de grabado.\""},
[211390] = {name = "Runa de Provocar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Pícaro\nGrabas en tu pechera o túnica la runa de Una simple herida superficial:\n\n\nRecibes un 20% menos de daño físico mientras dura Danza de hojas. Además, tienes un 6% menos de probabilidad de recibir golpes críticos de ataques cuerpo a cuerpo, la amenaza generada por todas tus acciones aumenta enormemente y tu facultad Amago se sustituye por Chinchar, que provoca al objetivo para que te ataque.\n\n\nProvoca al objetivo para que te ataque, pero no tiene efecto si ya te está atacando.\n\"Te enseña una nueva facultad de grabado.\""},
[211391] = {name = "Runa de Lluvia de sanación", additional_info = "Se liga al recogerlo\nÚnico\nClases: Chamán\nGrabas en tu pechera o túnica la runa de Lluvia de sanación:\n\n\nSelecciona un área de 15 m alrededor del jugador seleccionado y sana (* 15 / 100) p. cada segundo a todos los miembros de su grupo que estén en su interior.\n\"Te enseña una nueva facultad de grabado.\""},
[211392] = {name = "Runa de Aflicción eterna", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus pantalones la runa de Aflicción eterna:\n\n\nDrenar vida, Drenar alma, Descarga de las Sombras, Cuchilla de las Sombras, Dolor abrasador, Incinerar y Poseer restablecen la duración de tu Corrupción en el objetivo.\n\"Te enseña una nueva facultad de grabado.\""},
[211393] = {name = "Runa de Furia enfocada", additional_info = "Se liga al recogerlo\nÚnico\nClases: Guerrero\nGrabas en tus guantes la runa de Furia enfocada:\n\n\nCon la doble empuñadura, tu daño físico y tu velocidad de movimiento aumentan un 10%.\n\"Te enseña una nueva facultad de grabado.\""},
[211419] = {name = "Puñado de escamas cambiantes", additional_info = "Se liga al recogerlo\nÚnico\n\"Estas escamas tan curiosas parecen emitir un leve brillo, como si no fuesen corpóreas del todo. Está claro que las impregna una magia maravillosa... Alguien habrá que te pueda contar más al respecto.\""},
[211420] = {name = "Dije de escamas cambiante", additional_info = "Se liga al recogerlo\nAlhaja\n+5 espíritu\nNecesitas ser de nivel 25\nEquipar: Protege al portador de los efectos de Oscuridad aplastante."},
[211421] = {name = "La caja", additional_info = "Se liga al recogerlo\nÚnico\nUso: Intenta usar una poderosa fuente de la Luz para destruir la caja.\n\"Al tocar la caja con las manos desnudas te invade una intensa sensación de intranquilidad..., pero también una inspiración creativa como nunca antes habías sentido.\""},
[211422] = {name = "Fragmento del Vacío", additional_info = "Se liga al recogerlo\nÚnico\n\"Todo lo que queda de la caja es un diminuto fragmento de un cristal de color negro intenso. Parece atraer y consumir la luz.\""},
[211423] = {name = "Guantes de cuero tocados por el Vacío", additional_info = "Guantes de cuero tocados por el Vacío [[SoD] Phase 1]\nSe liga al recogerlo\nÚnico-Equipado: [Void-Touched] (1)\nManos Cuero\n110 armadura\n+6 agilidad\n+6 aguante\n+4 espíritu\nDurabilidad 70 / 70\nNecesitas ser de nivel 25\nRequiere\nMarroquinería\n(100)\nEquipar: Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia.\nUso: Pierdes la cordura, lo que aumenta tu velocidad de ataque un 10% y la amenaza que generas durante 10 sec. (10 Min Reutilización)"},
[211443] = {name = "Hoja de ira", additional_info = "Se liga al recogerlo\nDos manos Espada\n31 - 47 Daño Velocidad 3.50\n(11.14 daño por segundo)\n50 armadura\n+3 fuerza\nDurabilidad 60 / 60\nNecesitas ser de nivel 13"},
[211444] = {name = "Capa de invocador", additional_info = "Se liga al recogerlo\nEspalda\n16 armadura\n+3 intelecto\n+1 espíritu\nNecesitas ser de nivel 13"},
[211445] = {name = "Arco corvo barbárico", additional_info = "Se liga al recogerlo\nA distancia Arco\n12 - 24 Daño Velocidad 2.40\n(7.50 daño por segundo)\nDurabilidad 50 / 50\nNecesitas ser de nivel 13"},
