[211449] = {name = "Perla del Vacío de vengador", additional_info = "Se liga al recogerlo\nÚnico: [Void Pearl] (1)\nAlhaja\n+10 Sombras Resistencia\nNecesitas ser de nivel 25\nEquipar: +18 p. de poder de ataque."},
[211450] = {name = "Perla del Vacío de invocador", additional_info = "Se liga al recogerlo\nÚnico: [Void Pearl] (1)\nAlhaja\n+10 Sombras Resistencia\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 11 p."},
[211451] = {name = "Perla del Vacío de acólito", additional_info = "Se liga al recogerlo\nÚnico: [Void Pearl] (1)\nAlhaja\n+10 Sombras Resistencia\nNecesitas ser de nivel 25\nEquipar: Aumenta la curación de los hechizos y los efectos hasta en 20 p."},
[211452] = {name = "Perla Brazanegra perfecta", additional_info = "Perla Brazanegra perfecta [[SoD] Phase 1]\nSe liga al recogerlo\nÚnico\nEste objeto inicia una misión\nNecesitas ser de nivel 25\n\"Aku'mai, el sirviente de los dioses antiguos, está muerto. A Bashana Tótem de Runa le interesaría mucho enterarse de esto.\""},
[211454] = {name = "Globo de agua extraño", additional_info = "Se liga al recogerlo\nÚnico\nEste objeto inicia una misión\nNecesitas ser de nivel 25"},
[211455] = {name = "Guantes sin dedos escurridizos", additional_info = "Se liga al recogerlo\nManos Cuero\n68 armadura\n+7 aguante\n+5 intelecto\nDurabilidad 35 / 35\nNecesitas ser de nivel 25\nEquipar: Aumenta la curación de los hechizos y los efectos hasta en 22 p.\nEquipar: Aumenta el daño causado por los hechizos de Naturaleza y los efectos hasta en 14 p."},
[211456] = {name = "Daga de sacrificio voluntario", additional_info = "Se liga al recogerlo\nÚnico\nUna mano Daga\n12 - 27 Daño Velocidad 1.50\n(13.00 daño por segundo)\n60 armadura\n+4 aguante\n+3 intelecto\nDurabilidad 65 / 65\nNecesitas ser de nivel 25\nEquipar: Aumenta el daño y la curación de los hechizos mágicos y los efectos hasta en 12 p."},
[211457] = {name = "Faja de defensor crepuscular", additional_info = "Se liga al recogerlo\nCintura Malla\n128 armadura\n+7 fuerza\n+9 aguante\nDurabilidad 40 / 40\nNecesitas ser de nivel 25\nEquipar: Defensa aumentada +4."},
[211458] = {name = "Escrito sobre Resguardo contra las Sombras", additional_info = "Se liga al recogerlo\nSostener con la mano izquierda\n40 armadura\n+4 aguante\n+3 intelecto\n+5 Sombras Resistencia\nNecesitas ser de nivel 25"},
[211460] = {name = "Rodela ártica antigua", additional_info = "Se liga al recogerlo\nMano secundaria Escudo\n725 armadura\n15 bloquear\n+7 aguante\n+8 espíritu\n+5 Escarcha Resistencia\nDurabilidad 100 / 100"},
[211461] = {name = "Cetro de lápida inscrito", additional_info = "Cetro de lápida inscrito [[SoD] Phase 1]\nSe liga al recogerlo\nA distancia Varita\n35 - 61 Sombras Daño Velocidad 1.50\n(32.00 daño por segundo)\n+1 espíritu\n+5 Sombras Resistencia\nDurabilidad 65 / 65"},
[211462] = {name = "Anillo de sustención eterna", additional_info = "Se liga al recogerlo\nDedo\n+3 aguante\n+8 espíritu"},
