[211465] = {name = "Botas Nimbus de perspicacia", additional_info = "Se liga al recogerlo\nPies Tela\n34 armadura\n+2 agilidad\n+5 intelecto\n+4 espíritu\nDurabilidad 35 / 35"},
[211466] = {name = "Faja de duramen de cuidador", additional_info = "Se liga al recogerlo\nCintura Cuero\n57 armadura\n+8 aguante\n+7 espíritu\nDurabilidad 30 / 30"},
