[211471] = {name = "Llave de Fonroca", additional_info = "Único"},
[211472] = {name = "Tratado de Destierro", additional_info = "Se liga al recogerlo\nÚnico\nReliquia Tratado\nClases: Paladín\nNecesitas ser de nivel 24\nGrabas en tus pantalones la runa de Exorcista:\n\n\nAhora se puede lanzar Exorcismo sobre cualquier objetivo y tiene un 100% más de probabilidades de asestar un golpe crítico a no-muertos y demonios.\n\"Aprendes una nueva facultad tras lanzar Ahuyentar a no-muerto contra 5 enemigos y luego matarlos con Exorcismo.\""},
[211476] = {name = "Runa de despertar de incendio", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tu pechera o túnica la runa de Lago de Fuego:\n\n\nLluvia de Fuego también deja un lago de fuego en el suelo que aumenta todo el daño de Fuego que infligís tus mascotas demoníacas y tú a los enemigos afectados un 40% durante 15 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[211477] = {name = "Runa de Incinerar", additional_info = "Se liga al recogerlo\nÚnico\nClases: Brujo\nGrabas en tus pantalones la runa de Incinerar:\n\n\nQuemas a tu enemigo, lo que le inflige de (222 / 100 *) a (258 / 100 *) p. de daño y aumenta todo el daño de Fuego que infliges un 25% durante 15 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[211482] = {name = "Ofrenda Rompelanzas", additional_info = "Se liga al recogerlo\nÚnico"},
[211487] = {name = "Explosivos de demolición", additional_info = "Se liga al recogerlo\nÚnico\nUso: Coloca una bomba de mecha corta en el suelo frente a ti.\n\"Solo parecen útiles para despejar escombros y cascotes.\""},
[211488] = {name = "Runa del vengador", additional_info = "Se liga al recogerlo\nÚnico\nClases: Paladín\nGrabas en tus pantalones la runa de Escudo de vengador:\n\n\nLanza un escudo Sagrado al enemigo, inflige (366 */ 100 + 0.091 * Spell power + 0.091 * Attack power)-(448 */ 100 + 0.091 * Spell power + 0.091 * Attack power) p. de daño Sagrado y lo deja atontado. A continuación, salta a los enemigos cercanos. Afecta a 3 objetivos en total. Dura 10 sec.\n\"Te enseña una nueva facultad de grabado.\""},
[211490] = {name = "Profecía de las Mil Luces", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus guantes la runa de Círculo de sanación:\n\n\nSana de (* 130 / 100) a(* 144 / 100) p. a todos los miembros del grupo del jugador objetivo en un radio de 40 m.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth.\n\"Aprendes una nueva facultad de grabado.\""},
