[211492] = {name = "Bolsa de Kelris", additional_info = "Se liga al recogerlo\nBolsa de almas de 16 casillas\nClases: Brujo"},
[211498] = {name = "Sable de la noche de centinela de aprendiz", additional_info = "Se liga al recogerlo\nMontura\nRequiere cualquier raza de la Alianza\nNecesitas ser de nivel 25\nUso: Invoca el sable de la noche de centinela de un aprendiz. Solo se puede usar en Vallefresno. (3 Seg Reutilización)"},
[211499] = {name = "Lobo escolta de aprendiz", additional_info = "Se liga al recogerlo\nMontura\nRequiere cualquier raza de la Horda\nNecesitas ser de nivel 25\nUso: Invoca el lobo escolta de un aprendiz. Solo se puede usar en Vallefresno. (3 Seg Reutilización)"},
[211500] = {name = "Cinta de tela resistente", additional_info = "Se liga al recogerlo\nÚnico\nCabeza Tela\n50 armadura\nDurabilidad 50 / 50\nNecesitas ser de nivel 20\nEquipar: Mientras estás en la Garganta Grito de Guerra, reduce un 5% todo el daño recibido y la probabilidad de recibir golpes críticos."},
[211501] = {name = "Coselete de poderío", additional_info = "Se liga al recogerlo\nPecho Placas\n749 armadura\n+27 fuerza\n+18 aguante\n+10 Fuego Resistencia\nDurabilidad 165 / 165\nClases: Guerrero\nNecesitas ser de nivel 60\nEquipar: Mejora tu probabilidad de conseguir un golpe crítico en 1%.\nEquipar: Mejora tu probabilidad de alcanzar el objetivo en un 1%.\n\nPlaca de batalla de poderío (0/8)\nCinturón de Poderío\nBrazales de Poderío\nCoselete de poderío\nGuanteletes de Poderío\nYelmo de Poderío\nMusleras de Poderío\nEspaldares de Poderío\nEscarpes de poderío\n(3) Conjunto : Aumenta el valor de bloqueo de tu escudo en 30 p.\n(5) Conjunto : Te da un 20% de probabilidad de generar 1 punto de ira extra siempre que recibas algún daño. (Probabilidad de que accione: 20%)\n(8) Conjunto : Aumenta la amenaza generada por Hender armadura en un 15%."},
[211502] = {name = "Guanteletes de cuero tocados por el Vacío", additional_info = "Se liga al recogerlo\nÚnico-Equipado: [Void-Touched] (1)\nManos Cuero\n70 armadura\n+5 aguante\n+7 intelecto\n+6 espíritu\nDurabilidad 70 / 70\nNecesitas ser de nivel 25\nRequiere\nMarroquinería\n(100)\nEquipar: Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia.\nUso: Pierdes la cordura, lo que aumenta tu daño con hechizos un 10% y la amenaza que generas durante 10 sec. (10 Min Reutilización)"},
[211504] = {name = "Cota de malla de vengador Crepuscular", additional_info = "Se liga al recogerlo\nPecho Malla\n218 armadura\n+9 fuerza\n+6 agilidad\n+8 aguante\nDurabilidad 120 / 120\nNecesitas ser de nivel 25\nEquipar: Defensa aumentada +4.\n\nMallas de vengador Brazanegra (0/3)\nBotas de vengador Crepuscular\nCota de malla de vengador Crepuscular\nYelmo de vengador Crepuscular\n(2) Conjunto : +12 p. de poder de ataque.\n(3) Conjunto : Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia."},
[211505] = {name = "Yelmo de vengador Crepuscular", additional_info = "Se liga al recogerlo\nCabeza Malla\n176 armadura\n+9 fuerza\n+11 agilidad\n+3 aguante\nDurabilidad 70 / 70\nNecesitas ser de nivel 25\nEquipar: Defensa aumentada +4.\n\nMallas de vengador Brazanegra (0/3)\nBotas de vengador Crepuscular\nCota de malla de vengador Crepuscular\nYelmo de vengador Crepuscular\n(2) Conjunto : +12 p. de poder de ataque.\n(3) Conjunto : Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia."},
[211506] = {name = "Botas de vengador Crepuscular", additional_info = "Se liga al recogerlo\nPies Malla\n150 armadura\n+10 fuerza\n+5 aguante\nDurabilidad 60 / 60\nNecesitas ser de nivel 25\n\nMallas de vengador Brazanegra (0/3)\nBotas de vengador Crepuscular\nCota de malla de vengador Crepuscular\nYelmo de vengador Crepuscular\n(2) Conjunto : +12 p. de poder de ataque.\n(3) Conjunto : Aumenta en un 1% tu probabilidad de golpear con hechizos, ataques cuerpo a cuerpo y ataques a distancia."},
