[211514] = {name = "Notas sobre hechizos: Regeneración en masa", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tus pantalones la runa de Regeneración en masa:\n\n\nSana (* 42 / 100 * 3) p. de salud a todos los miembros del grupo del jugador objetivo en un radio de 30 m durante 3 sec y aplica Baliza temporal a cada objetivo durante 15 s.\n\n Baliza temporal\n\nRegistra la posición espaciotemporal del sujeto. Un 80% de todo el daño Arcano infligido por el taumaturgo se convierte en sanación cronomántica sobre cada uno de los objetivos actuales de su Baliza temporal. La sanación se reduce un 50% sobre uno mismo, y un 80% cuando se inflige daño con hechizos Arcanos que afectan a varios objetivos.\n\"Te enseña una nueva facultad de grabado.\""},
[211528] = {name = "Perspicacia oscura", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nUso: Examina cierta tumba apartada en el Bosque del Ocaso para recibir una profecía."},
[211530] = {name = "Profecía sobre una ciudad sometida", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tus pantalones la runa de Palabra de poder: barrera:\n\n\nInvoca una barrera sagrada para proteger a todos los miembros del grupo en la ubicación seleccionada durante 10 sec. La barrera reduce un 25% todo el daño recibido y evita que el daño retrase el lanzamiento de los hechizos.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth."},
[211531] = {name = "Profecía de los Siete Visitantes", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nGrabas en tu pechera o túnica la runa de Fuerza del alma:\n\n\nSanación inferior, Sanar, Sanación superior y Sanación relámpago reducen 4 s la duración restante de Alma debilitada en los objetivos a los que sanan. Además, los objetivos de tu Palabra de poder: escudo obtendrán ira por recibir daño a pesar de que el daño se absorba, y también se activará Furia recta a partir del daño que absorba Palabra de poder: escudo como si fuese sanación.\nUso: Concéntrate en la profecía para aprender un nuevo hechizo. Requiere una mente concentrada tras meditar sobre dos misterios espirituales de Azeroth."},
[211534] = {name = "Perspicacia primigenia", additional_info = "Se liga al recogerlo\nÚnico\nClases: Sacerdote\nUso: Examina un atrapasueños Piel de Cardo en lo alto de la copa para recibir una profecía."},
[211691] = {name = "Notas sobre hechizos: Explosión Arcana", additional_info = "Se liga al recogerlo\nÚnico\nClases: Mago\nGrabas en tus guantes la runa de Explosión Arcana:\n\n\nGolpea al objetivo con energía e inflige de (* 453 / 100) a (* 527 / 100) p. de daño Arcano. Cada vez que lances el hechizo Explosión Arcana, el daño y la sanación de todos tus otros hechizos Arcanos aumentará un 15% y el coste de maná de Explosión Arcana aumentará un 175%. El efecto se acumula hasta 4 veces y dura 6 sec o hasta que se lanza cualquier otro hechizo Arcano de daño o sanación.\n\"Te enseña una nueva facultad de grabado.\""},
