[211845] = {name = "Piedra de afilar Brazanegra", additional_info = "Uso: Cuando se aplica al arma del objetivo, aumenta la probabilidad de golpe un 2% durante 30 minutos. No tiene efecto fuera de las Cavernas de Brazanegra.\n\"Estas misteriosas piedras encantadas parecen brillar con mayor intensidad cuanto más te adentras en Brazanegra.\""},
[211846] = {name = "Diseño: piedra de afilar Brazanegra", additional_info = "Se liga al recogerlo\nRequiere\nHerrería\n(100)\nUso: Te enseña a hacer una piedra de afilar Brazanegra.\n\nPiedra de afilar Brazanegra\nUso: Cuando se aplica al arma del objetivo, aumenta la probabilidad de golpe un 2% durante 30 minutos. No tiene efecto fuera de las Cavernas de Brazanegra.\n\"Estas misteriosas piedras encantadas parecen brillar con mayor intensidad cuanto más te adentras en Brazanegra.\"\nRequiere Piedra de afilar burda , Esencia mágica inferior"},
[211848] = {name = "Aceite de maná Brazanegra", additional_info = "Necesitas ser de nivel 25\nUso: Cuando se aplica al arma del objetivo, restaura 12 p. de maná cada 5 s y aumenta el índice de golpe con hechizos un 2% durante 5 min. Solo surte efecto en las Cavernas de Brazanegra.\n5 cargas"},
